INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(64784, 'zhTW', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'zhTW', '眼鏡蛇靈魂', '將眼鏡蛇靈魂帶給森林之心的莫恩女士。', '<眼鏡蛇靈魂既貪婪又防衛心強。你將來能任意化身為眼鏡蛇之形態。>', '', '', '', '', '', '將眼鏡蛇靈魂帶給森林之心的莫恩女士。', 39653),
(64650, 'zhTW', '土狼靈魂', '將土狼靈魂帶給森林之心的莫恩女士。', '土狼靈魂火爆而輕盈。你將來能任意化身為土狼之形態。>', '', '', '', '', '', '將土狼靈魂帶給森林之心的莫恩女士。', 39653),
(64640, 'zhTW', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'zhTW', '塔札維許：殺價', '找出奧曼納的生意夥伴，然後提供你的協助', '啊，我的作品在你身上看起來不錯。你的形象非常得體！\n\n現在我已經為你貢獻了一己之力，你也應該回敬我一份心力。去金輝海灘找我的生意夥伴費塔吉德，為他提供你的協助。\n\n期待能聽到你的好消息。', '', '', '', '', '', '', 39653),
(64599, 'zhTW', '統御聖所：無罪不譴', '在傳奇難度中，於統御聖所從科爾蘇加德身上收集4個骨匣裂片。', '我可以感覺到巫妖科爾蘇加德就在迴廊裡。帶他骨匣的裂片來給我，我就能開啟一道新通道，直接進入他墓室。\n\n四個裂片應該就夠了，畢竟我們也不想看到他又回來，你說是吧？', '', '', '', '', '', '', 39653),
(64598, 'zhTW', '統御聖所：無罪不譴', '在英雄難度中，於統御聖所從科爾蘇加德身上收集4個骨匣裂片。', '我可以感覺到巫妖科爾蘇加德就在迴廊裡。帶他骨匣的裂片來給我，我就能開啟一道新通道，直接進入他墓室。\n\n四個裂片應該就夠了，畢竟我們也不想看到他又回來，你說是吧？', '', '', '', '', '', '', 39653),
(64597, 'zhTW', '統御聖所：無罪不譴', '在普通難度中，於統御聖所從科爾蘇加德身上收集4個骨匣裂片。', '我可以感覺到巫妖科爾蘇加德就在迴廊裡。帶他骨匣的裂片來給我，我就能開啟一道新通道，直接進入他墓室。\n\n四個裂片應該就夠了，畢竟我們也不想看到他又回來，你說是吧？', '', '', '', '', '', '', 39653),
(64571, 'zhTW', '塔札維許：用眼睛看，不要搞破壞', '', '', '', '', '', '', '', '', 39653),
(64567, 'zhTW', '失蹤的學者', '在科西亞找到學者羅述爾。', '啊，淵喉行者。你的歸來讓我們充滿希望，而且我們正好需要你的協助。\n\n有好幾個學者至今仍然下落不明。根據消息指出，他們失蹤前還在巨大的庭院裡鑽研學問。我們擔心他們可能迷路了，或是被那些想要干擾我們生活的傢伙抓走了。\n\n等你發現學者的下落之後，就回來找我。\n\n願道路指引你。', '', '', '', '', '', '', 39653),
(64562, 'zhTW', '我們需要治療者，就決定是你了！', '在追尋者議會治療$1oa名受傷的誓盟盟友。', '戰場上有太多傷員了！\n\n不是所有人都能夠硬撐下去。我們需要更多治療人員。\n\n就是你，拿著我的裝置，幫助傷兵重歸戰線！', '', '', '', '', '', '', 39653),
(64561, 'zhTW', '觀測紀錄', '在科西亞的向風之巢和甦醒河口收集$1oa個觀測紀錄。', '你好啊，淵喉行者，你有空嗎？\n\n想必你已經知道了，我的商業集團已經偷偷在科西亞的各個地方部署了觀察裝置。但如果無法取回觀察裝置的資料，那麼再多的觀察裝置都是徒勞。這種時候就得靠你了。\n\n向風之巢和甦醒河口那邊的紀錄應該已經準備就緒了。你看不見裝置本身，但是相關的資料看起來會像是發亮的球體。\n\n也別忘記找找看地底下方！\n\n把那些資料帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
(64560, 'zhTW', '取回靈魄', '從指引聖堂的吞噬者身上取回$1oa個被吞噬的靈魄。', '我們需要源源不絕的戰鬥人員、補給品和靈魄，才有辦法繼續努力下去。其中，靈魄最難以取得，原因想必不用我多說了。不過，我懂得如何變通。\n\n附近有個充沛的靈魄來源。也就是目前充斥在指引聖堂的吞噬者。雖然說用暴力強行取出靈魄並不是件容易的事情，但這麼做確實很有效。前提是你夠強。你辦得到嗎？', '', '', '', '', '', '', 39653),
(64557, 'zhTW', '揭示於黑暗之中', '在『譴罪之塔』托迦司找到維尼西。', '眾所皆知，維商集團願意為了財寶深入龍潭虎穴。如果他們還有理智的話，他們應該要把寶物的取得與販售權留給希商集團的。唉。\n\n有個維商集團成員帶著一箱強大的戰利品消失在托迦司，他以為帶那些東西就能安全探索那裡。真是瘋了！', '', '', '', '', '', '', 39653),
(64556, 'zhTW', '需要協助', '在科西亞各地完成3個米卡尼寇斯、塔那西和凱爾薩斯的每日任務', '棲息在科西亞的生物歷經劫難。要不是我們及時趕到，恐怕閻獄之主的部隊連玄秘之城的廢墟殘骸都不會放過，所到之處滿目瘡痍。\n\n我們必須協助需要幫忙的人，繼續加油努力。\n\n淵喉行者，傾聽盟友的呼喚。務必要搜遍這個地方，只要是閻獄之主的盟友都格殺勿論。', '', '', '', '', '', '', 39653),
(64555, 'zhTW', '調查秘密', '與科西亞的前線斥候交談。', '各大誓盟都派出了精通自身專業領域的能手。其中幾個人已經出動，正在偵察這片未知的土地。\n\n去找他們談話，他們應該都有記錄自己的調查結果。把調查資料帶回來給我。', '', '', '', '', '', '', 39653),
(64554, 'zhTW', '汎希爾進攻戰', '在墮滅堡和寂滅之面完成$1oa個任務。', '我們的攻擊行動把閻獄之主的爪牙打了個措手不及。我們要攻破墮滅堡，然後在統御祭壇擊敗他的勇士！\n\n淵喉行者，我們需要你的幫忙。去戰場上支援我們的部隊吧！', '', '', '', '', '', '', 39653),
(64553, 'zhTW', '靈魄湧泉傳說', '將靈魄湧泉傳說帶去罪殞城交給謀士莎卡。', '<這個東西看起來像是一連串不完整的筆記，上面詳細記載著博文者的研究內容，跟深藏在科西亞某處的神奇靈魄湧泉有關。\n\n罪殞城的謀士莎卡可以協助你召集人馬尋找這個泉源的下落。>', '', '', '', '', '', '將靈魄湧泉傳說帶去罪殞城交給謀士莎卡。', 39653),
(64552, 'zhTW', '靈魄湧泉傳說', '將靈魄湧泉傳說帶去樂土堡交給闊洛斯。', '<這個東西看起來像是一連串不完整的筆記，上面詳細記載著博文者的研究內容，跟深藏在科西亞某處的神奇靈魄湧泉有關。\n\n樂土堡的闊洛斯可以協助你召集人馬尋找這個泉源的下落。>', '', '', '', '', '', '將靈魄湧泉傳說帶去樂土堡交給闊洛斯。', 39653),
(64551, 'zhTW', '靈魄湧泉傳說', '將靈魄湧泉傳說帶去統御者之座交給莫里克‧費德斯嘉。', '<這個東西看起來像是一連串不完整的筆記，上面詳細記載著博文者的研究內容，跟深藏在科西亞某處的神奇靈魄湧泉有關。\n\n統御者之座的莫里克‧費德斯嘉可以協助你召集人馬尋找這個泉源的下落。>', '', '', '', '', '', '將靈魄湧泉傳說帶去統御者之座交給莫里克‧費德斯嘉。', 39653),
(64549, 'zhTW', '靈魄湧泉傳說', '將靈魄湧泉傳說帶去森林之心交給看守者鐘花。', '<這個東西看起來像是一連串不完整的筆記，上面詳細記載著博文者的研究內容，跟深藏在科西亞某處的神奇靈魄湧泉有關。\n\n森林之心的看守者鐘花可以協助你召集人馬尋找這個泉源的下落。>', '', '', '', '', '', '將靈魄湧泉傳說帶去森林之心交給看守者鐘花。', 39653),
(64541, 'zhTW', '死亡的代價', '', '', '', '', '', '', '', '', 39653),
(64532, 'zhTW', '最後的文物', '在緬懷聖庫內檢視失蹤文物的模樣，並購買研究報告：遠古聖壇。', '$n，我有天大的好消息。我發現最後一個失蹤的文物了！\n\n雖然尋找這些文物的過程並不容易，但我研發出合適的研究來協助你。\n\n請去看看最後一個失蹤的文物長什麼樣子吧。我們就快要找齊全部的文物了！', '', '', '', '', '', '', 39653),
(64531, 'zhTW', '莫傑斯', '', '', '', '', '', '', '', '', 39653),
(64530, 'zhTW', '墓翼水晶', '將墓翼水晶送去守衛者歇息地交給石鑄宗匠。', '<這個巨大的水晶碎片是從大型傀儡的軀體身上剝落下來的。水晶碎片的內部閃爍著能量的光芒。\n\n守衛者歇息地的石鑄宗匠可以使用這個水晶幫你強化墓翼。>', '', '', '', '', '', '將墓翼水晶送去守衛者歇息地交給石鑄宗匠。', 39653),
(64529, 'zhTW', '完好的阿奎隆核心', '將完好的阿奎隆核心送去守衛者歇息地交給帝歐司。', '<巨大吞噬者在臨死前，將阿奎隆的能量核心緊緊握在手裡，那肯定是它從附近被摧毀的其中一個阿奎隆身上拔出來的。這個能量核心看起來還很完整。\n\n守衛者歇息地的帝歐司能夠幫助你找到另一個阿奎隆來注入能量。>', '', '', '', '', '', '將完好的阿奎隆核心送去守衛者歇息地交給帝歐司。', 39653),
(64528, 'zhTW', '荒野獸鞍具', '將荒野獸鞍具送去守衛者歇息地交給雷頓。', '<在你從逃脫的荒野獸背上滑下來之後，牠抖動身體並將鞍具甩到你腳邊。暗夜妖精引導牠回到守衛者歇息地，牠則是依依不捨地離開你身旁。\n\n守衛者歇息地的雷頓說不定知道這樣的行為代表著什麼意思。>', '', '', '', '', '', '將荒野獸鞍具送去守衛者歇息地交給雷頓。', 39653),
(64527, 'zhTW', '觀察狩獵', '啟動戰爭模式，並在世界裡殺死$1oa個玩家。', '根據我們觀察你族類之間衝突的結果，獵物逃脫的機率居高不下。\n\n這對於我們的觀察行動來說很不利。\n\n觀察者拿到了某個工具，應該能夠改善你強迫衝突的能力。\n\n在我把那個工具交給你之前，我們要你證明你有意願挑起這樣的衝突，這樣子我們才能確定這次的投資會有回報。', '', '', '', '', '', '', 39653),
(64526, 'zhTW', '神秘的裂隙', '在緬懷聖庫內檢視失蹤文物的模樣，並向羅述爾購買修復的裂隙鑰匙。', '$n，非常感謝有你的幫忙。我從寶典中找到了更多沒有受損的文物。\n\n是否能夠找到這些文物的關鍵在於科西亞境內的奇特裂隙。\n\n我應該能夠打造出傳送通道，幫助你進入這些裂隙並找到更多失蹤的文物。\n\n按照慣例，我這次也有關於這些文物的樣本可供你參考。在出發之前，請務必先過去看看。', '', '', '', '', '', '', 39653),
(64522, 'zhTW', '偷來的科西亞補給品', '將偷來的科西亞補給品送去守衛者歇息地交給公爵夫人敏克絲。', '<這些補給品上面印有死亡先鋒軍的徽印，是從裂隙裡面偷偷竊取出來的。\n\n如果你能夠把這些補給品物歸原主，守衛者歇息地的公爵夫人敏克絲會很感激的。>', '', '', '', '', '', '將偷來的科西亞補給品送去守衛者歇息地交給公爵夫人敏克絲。', 39653),
(64521, 'zhTW', '獄誓戰鬥計畫', '將獄誓戰鬥計畫送去守衛者歇息地交給公爵夫人敏克絲。', '<這些戰鬥計畫詳細記載了各種進入科西亞的可能性，此外，還有完整報告負責說明該區域境內的死亡先鋒軍的防守能力。\n\n守衛者歇息地的公爵夫人敏克絲可以迅速將相關資訊傳達給需要知道的人。>', '', '', '', '', '', '將獄誓戰鬥計畫送去守衛者歇息地交給公爵夫人敏克絲。', 39653),
(64519, 'zhTW', '失落的寶庫', '檢視緬懷聖庫的失蹤文物。', '我研究過了，可能還有更多文物殘存在科西亞境內。那些文物應該就在小型寶庫裡面。\n\n如果你願意幫忙，我就能重新製作出裝置來修復通往這些寶庫的入口。\n\n有一些文物至今依然下落不明，我已經把它們的複製品擺上去了。請過去看看，這樣你才知道自己要找的是什麼東西。', '', '', '', '', '', '', 39653),
(64513, 'zhTW', '維萊恩的頭顱', '將維萊恩的頭顱送去維娜里避難所交給維娜里。', '<維萊恩獵殺維娜里已經有很長一段時間了。如果能夠看到維萊恩被殺死的證據，維娜里會很開心的。>', '', '', '', '', '', '將維萊恩的頭顱送去維娜里避難所交給維娜里。', 39653),
(64511, 'zhTW', '失蹤文物', '檢視緬懷聖庫的失蹤文物。', '多虧有你幫忙，我找回了更多有關寶庫失蹤文物的研究。\n\n我查過了寶典的內容，科西亞境內想必還有更多文物等待我們去尋找。\n\n這些文物被封印在寶箱裡面，在敵人首次發動攻擊的時候，這些寶箱應該就已經四散到了科西亞的各個地方。\n\n我把失蹤文物的相關資訊都記錄在此。將它們記在腦海裡吧。我們必須取回這些物件。', '', '', '', '', '', '', 39653),
(64509, 'zhTW', '時髦裝扮', '', '', '', '', '', '', '', '', 39653),
(64508, 'zhTW', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'zhTW', '必須找到的事物', '在緬懷聖庫查看有哪些遺失的文物。', '寶典裡面詳細記載了許多資訊。永遠失落的物品…還有至今尚存的物品。\n\n有些威力強大的文物說不定還沒有遭到破壞，而且現在就藏在科西亞的某處。\n\n進入聖庫吧。你會看到一些還在科西亞境內、還沒有被破壞的東西。\n\n將它們記在腦海裡。你必須找到那些物品，然後帶回來給我。', '', '', '', '', '', '', 39653),
(64469, 'zhTW', '冒險者：露希亞', '', '', '', '', '', '', '', '', 39653),
(64468, 'zhTW', '冒險者：伊札夫人', '', '', '', '', '', '', '', '', 39653),
(64467, 'zhTW', '冒險者：藝術家洽奇', '', '', '', '', '', '', '', '', 39653),
(64466, 'zhTW', '冒險者：亡牙', '', '', '', '', '', '', '', '', 39653),
(64465, 'zhTW', '冒險者：安西拉杜', '', '', '', '', '', '', '', '', 39653),
(64464, 'zhTW', '冒險者：萊拉‧冰風暴', '', '', '', '', '', '', '', '', 39653),
(64463, 'zhTW', '冒險者：靈氣靈魂嚮導', '', '', '', '', '', '', '', '', 39653),
(64462, 'zhTW', '冒險者：不可思議的庫洛瑪斯', '', '', '', '', '', '', '', '', 39653),
(64461, 'zhTW', '冒險者：赫密士提斯', '', '', '', '', '', '', '', '', 39653),
(64460, 'zhTW', '冒險者：亞恩拉爾', '', '', '', '', '', '', '', '', 39653),
(64459, 'zhTW', '冒險者：艾爾文', '', '', '', '', '', '', '', '', 39653),
(64458, 'zhTW', '冒險者：蘇拉諾姆', '', '', '', '', '', '', '', '', 39653),
(64441, 'zhTW', '鬆脫的絲線', '撿起書本，將其物歸原位。', '<在附近的汎希爾營地裡，最近好像有某本書從桌子上掉了下去。\n\n如果你能夠把這本書帶回去給汎希爾，讓這本書免於被哥羅米當成棲息的材料，汎希爾應該會對此表示感激。>', '', '', '', '', '', '', 39653),
(64438, 'zhTW', '強化裝備', '與助理學者卡維茲碰面，升級在科西亞境內找到的裝備。', '你找到的研究可以開創出許多新的可能性。\n\n其中一種可能性就是強化你在科西亞境內所找到的部分裝備。\n\n到附近和我的助理談談。他能用運用我們的研究恢復這個裝備以往的威力。', '', '', '', '', '', '', 39653),
(64437, 'zhTW', '通知統御者', '回去科西亞找統御者。', '$n，回去科西亞告訴統御者，就說凜冬女王的符印復原了。', '', '', '', '', '', '', 39653),
(64432, 'zhTW', '長處即是弱點', '強化聚雷針並殺掉淵誓者。', '$p，我們一直在收集的這些金屬碎塊擁有很特殊的性質。我認為淵誓者正在強化自身的護甲，提高其耐受程度。\n\n拿好這個聚雷針。首先，你得先被閃電擊中。不要用那副表情看我，你不會有事的。但是，你有必須同時接觸到淵誓者金屬。鑲在科西亞的大型鎖鍊應該是個不錯的選擇。\n\n在你…呃…獲得充沛電能之後，我會派牛獸伯爾哈斯帶你去戰鬥。', '', '', '', '', '', '', 39653),
(64376, 'zhTW', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'zhTW', '文物效益', '', '', '', '', '', '', '', '', 39653),
(64325, 'zhTW', '罪殞城精兵', '在奧睿博司的政要區與佐索格會面。', '$n，多虧有你，罪殞城的影響力與日俱增！\n\n你的功勞有目共睹，即使遠在瑞文崔斯外的人也略知一二。\n\n奧睿博司的人們在討論你的傳奇故事，衝突大師佐索格請你前往政要區與他會面。\n\n他對戰爭兵法有濃厚興趣，我建議你別讓對方等太久。', '', '', '', '', '', '', 39653),
(64324, 'zhTW', '死靈領主精兵', '在奧睿博司的政要區與佐索格會面。', '$n，由於你的貢獻，死靈領主的力量日益壯大。\n\n你的功勞有目共睹，即使遠在瑪卓薩斯外的人也略知一二。\n\n奧睿博司的人們在討論你的傳奇故事，衝突大師佐索格請你前往政要區與他會面。\n\n他對戰爭兵法有濃厚興趣，我建議你別讓對方等太久。', '', '', '', '', '', '', 39653),
(64323, 'zhTW', '琪瑞安精兵', '在奧睿博司的政要區與佐索格會面。', '$n，多虧你的努力，昇靈堡開始復原了。前方的道路再次變得明朗。\n\n你的功勞有目共睹，即使遠在昇靈堡外的人也略知一二。\n\n奧睿博司的人們在討論你的傳奇故事，衝突大師佐索格請你前往政要區與他會面。\n\n他對戰爭兵法有濃厚興趣，我建議你別讓對方等太久。', '', '', '', '', '', '', 39653),
(64322, 'zhTW', '暗夜妖精精兵', '在奧睿博司的政要區與佐索格會面。', '多虧有你，現在亞登曠野比過去一段時間要來得安全。\n\n你的功勞有目共睹，即使遠在瑞文崔斯外的人也略知一二。\n\n奧睿博司的人們在討論你的傳奇故事，衝突大師佐索格請你前往政要區與他會面。\n\n他對戰爭兵法有濃厚興趣，我建議你別讓對方等太久。', '', '', '', '', '', '', 39653),
(64314, 'zhTW', '煥然一新的誓盟', '與統御者交談，取得各大誓盟的符印。', '我們行動的主要目標是阻止閻獄之主破壞圍繞著淵喉的屏障，以免他入侵暗影之境的其他地方。\n\n結果出乎我們意料，他擴張淵喉居然是為了要包圍奧睿博司，並奪取審斷者的符印。\n\n我不太明白我們在托迦司頂端看到的景象意味著什麼。但統御者肯定了解。\n\n是時候展開他的緊急計畫了。各大誓盟很快就會帶著各自的符印趕來。\n\n去告訴統御者，說我們已經準備好開始了。', '', '', '', '', '', '', 39653),
(64306, 'zhTW', '任務完成條件', '', '', '', '', '', '', '', '', 39653),
(64304, 'zhTW', '新的機會在等待', '在科西亞殺死$1oa個玩家。', '這麼急著去哪裡呢？啊，對了，淵喉行者，你應該不會這麼剛好準備要進入淵喉探索全新未知的神祕領域吧？\n\n真不曉得淵喉裡面都藏有什麼樣的秘密呢。\n\n說不定我們能夠做點什麼來幫助彼此。\n\n如果你感興趣的話，我們可以好好聊聊。如果你不感興趣，就走吧。我自然會去找別人來幫我。', '', '', '', '', '', '', 39653),
(64292, 'zhTW', '『漫遊者』梅莉', '接下照顧梅莉的責任。', '你找到梅莉了！真是太感謝你了！說真的，我覺得她有點超出我照顧能力所及的範圍。\n\n你能不能幫我看著她呢？我覺得她對你是真的很有好感！', '', '', '', '', '', '', 39653),
(64290, 'zhTW', '收集研究', '與博文者羅述爾交談，繳交文物碎片以進行編目研究。', '你收集而來的這些碎片讓我們受用無窮，這些碎片將會幫助我們恢復往日收藏盛況。\n\n我可以利用你找到的東西來收集更多研究資料，釐清科西亞境內有哪些東西失落。\n\n在這之後，需要靠你在科西亞境內尋找更多的碎片和文物，以拓展我們的收藏。', '', '', '', '', '', '', 39653),
(64289, 'zhTW', '撿拾殘片', '從科西亞各地的稀有生物和寶藏取回50個文物碎片。', '在科西亞被拉入淵喉的時候，許多人事物都因此葬送。\n\n無價的文物四分五裂、支離破碎。我看見不少生物身上都攜帶著這些物品的殘片。\n\n我們必須取回這些殘片。\n\n正面迎戰閻獄之主的部隊還有在科西亞的廢墟中尋找，來自昔日輝煌寶庫的文物碎片。', '', '', '', '', '', '', 39653),
(64288, 'zhTW', '維娜里的楷模', '在淵喉的維娜里避難所與維娜里交談。', '來吧，淵喉行者。到我的避難所來找我。\n\n我們還有最後一件事情要商量。\n\n…請務必確認沒有人在跟蹤你。', '', '', '', '', '', '', 39653),
(64287, 'zhTW', '博文者寶典的楷模', '在科西亞的緬懷聖庫與博文者羅述爾交談。', '淵喉行者，你為了恢復我們珍愛的至寶，做出了很大的努力。\n\n等你準備好之後，到我的房間來找我。我們還有最後一件事情要商量。', '', '', '', '', '', '', 39653),
(64286, 'zhTW', '死亡先鋒軍的楷模', '在科西亞的守衛者歇息地與公爵夫人敏克絲交談。', '行動召集的命令再次獲得響應。你的努力大家有目共睹。\n\n我來看看要拿什麼樣的獎勵來報答你比較合適。', '', '', '', '', '', '', 39653),
(64282, 'zhTW', '驚喜連連', '找到佐瓦爾的寶庫。', '淵喉行者，你這個人真是讓我驚喜連連，沒想到你會出現在這裡！\n\n既然我們兩個都在，不如就一起合作吧。\n\n閻獄之主在這個裂隙裡有個寶庫，寶庫內滿滿都是金銀財寶。幫我找到那個寶庫，或是直接把寶庫帶過來這裡打開，我們到時候一起瓜分財寶！', '', '', '', '', '', '不論有沒有找到佐瓦爾的寶庫，都回去找維娜里。', 39653),
(64274, 'zhTW', '追蹤任務', '', '', '', '', '', '', '', '', 39653),
(64273, 'zhTW', '牽制獄誓者', '', '', '', '', '', '', '', '', 39653),
(64271, 'zhTW', '更文明的方法', '在通往科西亞的道路旁邊與娜迪亞碰面。', '啊，$p。\n\n我有件事情要跟你商量。但是我們不能在這裡談。\n\n<娜迪亞用一種可疑的眼神看著守衛者的喘息處的其他居民。>\n\n我們在淵喉通往科西亞的那條路上碰面，到時候再詳細說明。', '', '', '', '', '', '', 39653),
(64267, 'zhTW', '來自維娜里的神秘禮物', '在淵喉的維娜里避難所與維娜里交談。', '淵喉行者，你不屈不撓的求生意志以及還算傑出的表現令我印象深刻。你讓我想起了年輕時天真的自己。\n\n拿著這個，然後去…比較不那麼顯眼的地方繼續加油吧。', '', '', '', '', '', '', 39653),
(64266, 'zhTW', '博文者寶典的補給品', '在科西亞的緬懷聖庫與博文者羅述爾交談。', '你的奉獻保全了科西亞的歷史，我內心裡所感受到的溫暖難以用文字形容。\n\n拜託了。請讓我聊表謝意吧。', '', '', '', '', '', '', 39653),
(64255, 'zhTW', '派對時間', '', '', '', '', '', '', '', '', 39653),
(64216, 'zhTW', '高塔知識', '將萬應寶盒放置在托迦司。', '你必須用驕傲和回憶餵養這個盒子，才能解鎖它封存的力量。我曾經在其他界域見過這個盒子所蘊藏的魔咒，它們可以用來吸取或控制靈魂。這個…可憎的東西…把本該是救贖和榮耀的過程轉化為一個鎖。\n\n每當你在挑戰托迦司的樓層時，你的技巧、速度和效率都會轉化成高塔知識，成為這個盒子所吸收的養分。\n\n好好培育它，然後汲取它蘊含的力量。', '', '', '', '', '', '將萬應寶盒放置在托迦司。', 39653),
(64214, 'zhTW', '希望的象徵', '協助檢查安杜因的羅盤。', '在安杜因跟隨閻獄之主穿過傳送門之前，他丟下了某樣東西。\n\n我不確定那是什麼，總之珍娜撿起來了。說不定這是個跡象，代表安杜因還在對抗閻獄之主的力量！\n\n我們必須釐清這個東西是何物，還有年輕的國王為什麼要留下這個東西。', '', '', '', '', '', '', 39653),
(64213, 'zhTW', '希望的象徵', '協助珍娜檢查安杜因的羅盤。', '在安杜因跟著閻獄之主穿過傳送門之前，他丟下了某樣東西。\n\n我並不認為這是閻獄之主有意為之。這肯定說明著，安杜因的靈魂還沒有完全受到操控！\n\n<珍娜打開手掌，裡頭有一個黃金羅盤。>\n\n這個是安杜因相當珍視的貼身之物。我能夠從中感覺到他的氣息。\n\n我們必須釐清他為什麼要把這個東西留給我們。', '', '', '', '', '', '', 39653),
(64212, 'zhTW', '黑暗通道', '與索爾交談，並見證托迦司戰役的結局。', '凡人，阻止佐瓦爾的計畫恐怕是遇到了麻煩。\n\n通往禁忌國度的通道被人打開…而且監禁者重新奪回了他很久以前所擁有的力量。\n\n我感應到你的盟友正在從統御聖所返回的路上。我必須要知道究竟發生了什麼事。', '', '', '', '', '', '', 39653),
(64211, 'zhTW', '黑暗通道', '與珍娜交談，並見證托迦司戰役的結局。', '凡人，阻止佐瓦爾的計畫恐怕是遇到了麻煩。\n\n通往禁忌國度的通道被人打開…而且監禁者重新奪回了他很久以前所擁有的力量。\n\n我感應到你的盟友正在從統御聖所返回的路上。我必須要知道究竟發生了什麼事。', '', '', '', '', '', '', 39653),
(64210, 'zhTW', '萬應寶盒', '把萬應寶盒帶去給符刻師。', '啊，是淵喉行者。我就快撐不下去了，我會永遠化作這地方的一部分，而你卻還能繼續探索，屹立不搖！\n\n我抱著莫大的期望，這個寶盒能克服所有挑戰。可惜啊，我太高估自己的本事了。\n\n但我相信，我沒有高估你的能耐。拿走這個寶盒，證明你有資格擁有它吧。', '', '', '', '', '', '', 39653),
(64202, 'zhTW', '交給你', '接受尼爾甘瑪的幫助。', '淵喉行者，你的力量…能與我並駕齊驅，與佐瓦爾撕裂我身軀之前的力量匹敵。\n\n這只不過是我的一小部分而已，但這樣就足夠了…\n\n請讓我協助你對抗佐瓦爾吧。如此一來，我就可以完成復仇大業了。', '', '', '', '', '', '', 39653),
(64194, 'zhTW', '戰爭原型兵器', '在向風之巢使用亞特里奧斯原型擊敗凱拉克西斯。', '身為首席熔爐士，我會不辭勞苦地把事情做到盡善盡美！\n\n但是最巨大的百衛因為體型過於龐大，沒辦法帶去科西亞。我能夠解決這個問題。為你介紹亞特里奧斯，這是戰場巨像原型，也是琪瑞安的守禦先鋒！\n\n目前還需要進行測試，需要更多的測試，必須完美到能夠對抗力量強大的敵人。\n\n去吧，帶著亞特里奧斯去打倒厲害的淵喉野獸！按下全部的按鈕！', '', '', '', '', '', '', 39653),
