(64168, 'zhTW', '勇士：瑪拉茲莫斯孢子', '', '', '', '', '', '', '', '', 39653),
(64166, 'zhTW', '隨機記憶存取', '使用倏忽即逝的翅膀收集科西亞人的記憶。', '閻獄之主把科西亞強行拉入淵喉的時候，這個地方被毀到面目全非的地步。不只摧毀了山岳和建築物，就連人民也死傷慘重。\n\n人們原本的生活、夢想和記憶，也都隨之葬送。\n\n但我不願意放棄希望，我們說不定還能夠搶救他們殘留在這個世界上的最後一絲痕跡。\n\n來，取走我的一部分力量，看看你能否收集那些回憶。把那些記憶帶回來給我，我會好好加以保管的。\n\n沒有人應該被遺忘。', '', '', '', '', '', '', 39653),
(64138, 'zhTW', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'zhTW', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64106, 'zhTW', '眾志成城', '在淵喉協助誓盟攻擊閻獄之主的部隊。', '你跟你的所屬誓盟以及暗影之境的其他勢力結為了強力的盟友。正是因為這份羈絆，所以你的盟友決定協助我們達成目標。\n\n他們已經準備好與我們並肩作戰，一起進軍淵喉。\n\n每個誓盟都會從不同的區域打擊閻獄之主。協助他們在這個邪惡國度中掃蕩佐瓦爾的所有爪牙，終結他不斷擴張的勢力。', '', '', '', '', '', '', 39653),
(64103, 'zhTW', '老派作風最棒', '殺死淵誓指揮官：莫洛斯、歐吉斯和阿佩特。', '$p，我們又再次與彼此攜手奮戰，保護暗影之境的安全。\n\n這場戰爭對我們不利，但我們說不定有機會扭轉頹勢。我需要你去獵捕某幾位淵誓者部隊的指揮官。每一支軍隊都會有優秀的指揮官和無能的指揮官。失去優秀的指揮官，就只能讓無能的指揮官帶領作戰，敵方部隊自然也就會遭到削弱。\n\n我們的眼睛已經蒐集好敵情，我需要你去幫我殺掉我所掌握的名單。', '', '', '', '', '', '', 39653),
(64101, 'zhTW', '正確的作為', '收集$1oa個失落的靈魄容器。', '我來此原先是為了要觀察來自瑞文崔斯的人的所作所為。但我卻接獲令人擔憂的消息。\n\n$p，侍從告訴我他們把靈魄保存在容器裡面，但我們的同胞卻正在搜刮那些容器裡面的靈魄。這麼做是不正確的。\n\n請你幫我取回靈魄，然後把靈魄物歸原位。你願意幫我這個忙嗎？', '', '', '', '', '', '', 39653),
(64092, 'zhTW', '尋找胡恩', '穿上偽裝，一邊躲避守衛，一邊在威權要塞尋找胡恩‧高嶺。', '胡恩就在這附近的某個地方…但是石鑄宗匠不願意讓任何人進入她的地盤。這都是因為最近…呃…發生了一點跟驚懼領主有關的問題。那些守衛不放任何人通行，也把所有看起來可疑的人都給趕出來了。\n\n但胡恩很走運，因為棍臉和我想到了一個萬無一失的絕妙計畫！\n\n只要我們看起來不可疑，就可以到處打聽胡恩的下落了。就是這麼簡單！', '', '', '', '', '', '', 39653),
(64091, 'zhTW', '不當挪用', '收集束縛符印', '<驚懼領主與你四目相接，對方想要跟你說話。你瞥了一眼身旁的同伴。月莓露出調皮的笑容，鼓勵你往前走。你鼓起勇氣盡可能靠近對方。>\n\n凡人，只要你把我從這個監牢裡面放出來，我就欠你一個人情。我所擁有的力量，遠超過這些可悲的傀儡和他們的主人。他們根本不曉得真正的力量是什麼。\n\n我只需要困住我的束縛符印。其他的…我可以自己來。\n\n放了我，我就會賦予你驚人的力量。', '', '', '', '', '', '', 39653),
(64090, 'zhTW', '營救行動', '前往棍臉認為胡恩被抓去的地方，然後混進去。', '看來那個失蹤的傢伙被抓去處理了。還好我很聰明，有個好點子。\n\n我們偷偷摸摸進去，假裝自己是工作人員，然後找到你的目標，不要看那些尖牙齒的，最後再像個石匠那樣鑿一條路逃出去。來嗎？', '', '', '', '', '', '', 39653),
(64086, 'zhTW', '琪瑞安戰術大師', '在奧睿博司的政要區與佐索格會面。', '$n，看看你周圍吧。樂土堡證明了你的貢獻為我們帶來了多少進步。\n\n佐索格再次請你前往奧睿博司。立刻動身吧。\n\n我們可不能錯過佐商集團的善意，贏得仲介者集團的信任絕非易事。\n\n他們說不定會為你準備更豐厚的賞賜。', '', '', '', '', '', '', 39653),
(64085, 'zhTW', '暗夜妖精戰術大師', '在奧睿博司的政要區與佐索格會面。', '你的勇氣讓亞登曠野得以重新生長。這也再次引起了仲介者的注意。\n\n佐索格再次請你前往奧睿博司。立刻動身吧。\n\n我們可不能錯過佐商集團的善意，贏得仲介者集團的信任絕非易事。\n\n他們說不定會為你準備更豐厚的賞賜。', '', '', '', '', '', '', 39653),
(64084, 'zhTW', '死靈領主戰術大師', '在奧睿博司的政要區與佐索格會面。', '你為死靈領主爭取了輝煌的榮耀。這等榮耀再次吸引了其他人的注目。\n\n佐索格再次請你前往奧睿博司。立刻動身吧。\n\n我們可不能錯過佐商集團的善意，贏得仲介者集團的信任絕非易事。\n\n他們說不定會為你準備更豐厚的賞賜。', '', '', '', '', '', '', 39653),
(64083, 'zhTW', '罪殞城戰術大師', '在奧睿博司的政要區與佐索格會面。', '罪殞城的聲望與日俱增，更甚戴納瑟斯一直希望達到的程度！$n，這全都是你的功勞！\n\n佐索格再次請你前往奧睿博司，立刻動身吧。\n\n我們可不能錯過佐商集團的善意，贏得仲介者集團的信任絕非易事。\n\n他們說不定會為你準備更豐厚的賞賜。', '', '', '', '', '', '', 39653),
(64080, 'zhTW', '墜地', '使用克芮恩的標槍刺中$1oa個淵誓先驅者。', '我能夠聽得見淵誓者在天空拍動翅膀的聲音，他們這是在挑釁我們。\n\n不過落入手中的鳥兒，輕易就能捏爆。\n\n拿著我的長矛，讓他們見識你高超的投擲技巧，把幾個淵誓者拉到地面上然後痛宰對方。\n\n請一定要使用長矛，不要直接在他們面前閒晃，不然他們會降落到地面上追你，這樣就沒意義了。\n\n我想要看你把他們從天空拽下來。', '', '', '', '', '', '', 39653),
(64070, 'zhTW', '化腐朽為神奇', '收集$1oa個淵誓者的金屬碎塊。', '我們的部隊總是缺少足夠的武器、護甲和人手。每次都這樣。\n\n我們雖然有援軍幫忙，但是照這樣下去，我會沒有辦法提供所有人足夠的裝備。尤其是我現在還沒有完整的鍛爐，也沒有助手可以幫忙。\n\n眼下，我們也只能退而求其次。我需要你幫忙從淵誓者身上盡量多找一些金屬碎塊過來給我。我們想辦法把那些金屬碎塊製作成有用的武器。', '', '', '', '', '', '', 39653),
(64065, 'zhTW', '就地取材', '收集$1oa個晶皮之爪、$2oa個哥羅米之足和$3oa個刃翼脊刺。', '科西亞這個地方真是古怪。這邊的野生動物特別不一樣，應該是因為長期暴露在寶庫和裡面東西的影響下所導致的。\n\n你準備好來進行一點實驗了嗎？首先，我們需要許多的實驗材料。\n\n在追尋者議會附近，你應該能夠找到晶皮、哥羅米和刃翼。小心不要被螫到了！', '', '', '', '', '', '', 39653),
(64043, 'zhTW', '我們需要治療者，就決定是你了！', '在追尋者議會治療$1oa名受傷的誓盟盟友。', '戰場上有太多傷員了！\n\n不是所有人都能夠硬撐下去。我們需要更多治療人員。\n\n就是你，拿著我的裝置，幫助傷兵重歸戰線！', '', '', '', '', '', '', 39653),
(64042, 'zhTW', '黑夜儀式', '協助準備工作並進行儀式。', '泰蘭妲的時間不多了，我們必須盡快行動。\n\n<伊瑟拉皺起眉頭，神色擔憂。>\n\n我們原本希望還能找到更多黑夜戰士，但事到如今，我們也只能就現有的人手硬著頭皮上了，但願這麼做行得通。\n\n<伊瑟拉搖搖頭，接著露出充滿決心的神情。>\n\n在我們正式開始之前，我們必須做好進行儀式的準備。請把最後這幾個物品帶在身上，然後到林地與我們碰面。', '', '', '', '', '', '', 39653),
(64018, 'zhTW', '石之重量', '協助石源魔軍團運送補給品和靈魄。', '$p，這場戰爭還沒結束。石源魔軍團打算來扭轉戰局了。\n\n首先，我們必須運送補給品去給盟友。科西亞的土地支離破碎，這代表我們是唯一有辦法持續供給我方軍隊補給品的人。\n\n再者，我們還必須對付那些淵誓者和吞噬者。我有個非常簡單的策略。我們要在淵誓者身上投放靈魄。這樣子，吞噬者就會被吸引過去攻擊淵誓者。結果只有兩種，吞噬者殺掉淵誓者，或淵誓者殺掉吞噬者。但不論結果如何，我們都可坐收漁翁之利。', '', '', '', '', '', '', 39653),
(64014, 'zhTW', '淵喉的教誨', '請維娜里協助把伊斯卡號角跟淵喉連結起來。', '在我們光榮開戰前，還剩下最後一件事需要完成。要將號角跟淵喉連結，它的聲音才能貫穿環繞邪惡界域的屏障。\n\n實際怎麼做，我並不知道。你要找一個熟悉當地秘密的人。應該有那樣的人可以幫你。\n\n丹妮卡和她的姊妹會等待伊斯卡號角的呼喚。$n，當你需要她們，她們就會回應。', '', '', '', '', '', '', 39653),
(64012, 'zhTW', '死亡先鋒軍的補給品', '在科西亞的守衛者歇息地與公爵夫人敏克絲交談。', '你盡力對抗閻獄之主進逼，大家都看在眼裡。如果你需要力量堅持下去，那麼我應該能夠幫上一點忙。', '', '', '', '', '', '', 39653),
(64007, 'zhTW', '誓盟的進擊', '召集各大誓盟的部隊，進攻淵喉。', '多虧有你和其他艾澤拉斯英雄的努力，誓盟變得堅強有力。但我們不能坐等閻獄之主展開他的下一步行動。\n\n我們必須主動出擊！\n\n通往淵喉的道路已經打開。我們的部隊準備好了。\n\n$n，誓盟就等你一聲令下。', '', '', '', '', '', '到科西亞與伯瓦爾‧弗塔根交談。', 39653),
(63994, 'zhTW', '誰是淵喉行者？', '參加塔迦蘭的淵喉行者試煉。', '科西亞的預言記載著，有一天會有淵喉行者來到此處，拯救我們免於災難。\n\n說不定今天就是預言裡所說的那一天。但也有可能不是。我必須測試你的靈魄，才有辦法確定。\n\n如果你所言不假，那麼我神聖的使命就是強化你的靈魄，然後我們才能夠再繼續往前進。', '', '', '', '', '', '', 39653),
(63990, 'zhTW', '黑夜之刃', '在知識墓穴尋找線索。', '儘管搜尋過程艱鉅，但我找到兩個可靠的情報，能夠帶領我們找到更多的黑夜戰士。第一個黑夜戰士就在瑪卓薩斯這裡。\n\n高塔的資料記載著哪些人來過瑪卓薩斯，裡面包括被稱作「黑夜之刃」的這麼一號人物。我認為這個人就是我們接下來要尋找的黑夜戰士。\n\n我在來這裡的路上碰到了許多陷阱，高塔裡面有更多陷阱也不意外。有人想要阻止我們。\n\n我們不能讓對方得逞。', '', '', '', '', '', '', 39653),
(63989, 'zhTW', '有個性的軟泥怪', '在重擊者瞰台幫助小瘟泥測試感染能力。', '學徒！你跑哪裡去了？我到處在找你。\n\n凱文在我們的實驗中幫了大忙，我想要訓練其他的軟泥怪，讓他們也能一起來幫忙！\n\n你可以帶著小瘟泥去測試感染有機生命體的能力嗎？', '', '', '', '', '', '', 39653),
(63987, 'zhTW', '維洛爾的失落包裹', '', '', '', '', '', '', '', '', 39653),
(63986, 'zhTW', '塔札維許：失落神器的劫掠者', '進入塔札瓦蘇並擊敗索利亞。', '我親愛的朋友，看來你又得稍微動用一下武力了。塔札維許的守衛不會這麼輕易就讓我們進去。\n\n但我們必須阻止索利亞，如果說我們不得不…用拳頭講道理的話，那也只能說這是必要之惡了。\n\n多帶幾個朋友過來，我總感覺這邊的守衛會耍陰招。', '', '', '', '', '', '', 39653),
(63985, 'zhTW', '帷幕市集', '搭乘接駁船前往塔札維許。', '我猜猜…是塔歐庫叫你來找我的，對吧？\n\n<塔梅利看著你交出來的那枚硬幣。>\n\n看來你是想要前往塔札維許呢。雖然我們通常不會帶外來者去塔札維許，但既然你都已經付費了，我願意破例協助你。\n\n上船吧，切記，手腳不要伸到船的外面。誰也料不準間域的水流會發生什麼樣的變化。', '', '', '', '', '', '', 39653),
(63984, 'zhTW', '船夫的硬幣', '在奧睿博司與塔梅利交談。', '淵喉行者，你的任務完成了。接下來是酬勞的部分。\n\n我的商業集團有經營往返奧睿博司和塔札維許的渡船生意。渡船原本是拿來運載貨物的，但凡事總可以有…例外。\n\n帶著這枚硬幣去找塔梅利，這樣子你就能夠安全抵達市集。\n\n在那之後，你就只能隨機應變了。\n\n<塔歐庫一鞠躬，並發出類似咯咯笑的聲音。>', '', '', '', '', '', '在奧睿博司與塔梅利交談。', 39653),
(63983, 'zhTW', '間諜交易', '取回原型阿奎隆。', '塔恩拉代表某個客戶跟我指定要一個非常…特別…的東西。\n\n琪瑞安最近一直在研究如何打造名為「阿奎隆」的新型百衛。我派出了幾個交易專家去取回我們這次所需要的原型，但是他們遲遲沒有回來。\n\n如果東西拿不到手，我就沒辦法把貨物運送給塔恩拉。說不定我們能夠互相幫助。\n\n如果你能夠找到阿奎隆，把它帶過來這裡，我就協助你前往塔札維許。', '', '', '', '', '', '', 39653),
(63982, 'zhTW', '轉運中心', '穿過深夜市集的傳送門，然後與塔歐庫交談。', '我確實知道帷幕市集的所在位置，但我恐怕無法提供你前往那個市集的運輸工具。\n\n如果你願意協助我完成這項任務，我就可以介紹你認識某個能夠幫助我們雙方的人。昇靈堡的仲介者營地「塔商轉運站」那邊有一位賞金獵人。他比較適合幫助你…而且他欠我一批貨物。\n\n去找塔歐庫，跟他說是塔恩拉派你去的。\n\n為了幫你節省時間，我可以讓你使用傳送門。畢竟我們可是合作夥伴呢，你說是吧？', '', '', '', '', '', '在塔商轉運站與賞金獵人塔歐庫交談。', 39653),
(63980, 'zhTW', '尋找走私販', '在深夜市集與『鑑定者』塔恩拉交談。', '我們仲介者發現不斷四處移動對我們來說最為理想。這樣也比較慎重。\n\n我們的許多城市和哨站都隱藏在間域之中，能夠在不同的地方之間來回往返。\n\n令人懊惱的是，我好像找不到塔札維許了。\n\n我認為目前的最佳行動方案就是請塔商集團帶我們進去。他們最引以為傲的技能，就是能夠追查各種東西的下落。\n\n我們去瑞文崔斯的深夜市集找仲介者碰碰運氣吧。那邊的仲介者應該會比奧睿博司的仲介者還要樂意幫忙。', '', '', '', '', '', '在瑞文崔斯的深夜市集與『鑑定者』塔恩拉交談。', 39653),
(63979, 'zhTW', '別把內幕說出來', '找到索商集團的運送貨單。', '淵喉行者，索商集團的領袖對於暗影之境來說是個莫大的威脅。\n\n她的名字叫做索利亞。她打算把首創者的神器組合起來，用那個神器來達成自己的目的。\n\n據說那個神器的其中幾個碎片就隱藏在你的家園。仲介者還沒有去過艾澤拉斯。但如果索利亞得逞，艾澤拉斯也會深陷危機之中。\n\n我們必須阻止她。\n\n這附近有一些索商集團的貨物。說不定透過這批貨物的運送清單能夠查出索利亞下落的線索。', '', '', '', '', '', '', 39653),
(63977, 'zhTW', '內線交易', '在奧睿博司各處與不同的仲介者集團交談。', '我是熟知仲介者文化的業界頂尖專家，不過這些集團之間的關係一言難盡，而且經常變動。\n\n索商集團在奧睿博司這個地方有點影響力，也就是說其他集團手上或許會握有我所沒有的情報。到處打聽看看，利用你的知名度，鐵定能拿到我們缺少的資訊。', '', '', '', '', '', '', 39653),
(63976, 'zhTW', '奧睿博司的巷弄小貓', '前往奧睿博司與神秘的聯絡人碰面。', '啊，淵喉行者。我這有個訊息。\n\n有個人有個提案，指定要找你。細節的部份我完全不清楚，我只知道對方請你去恬靜旅店的後面跟他們碰頭。', '', '', '', '', '', '前往奧睿博司與神秘的聯絡人碰面。', 39653),
(63973, 'zhTW', '雙重樹林長', '一路上協助艾利歐德樹林長擊敗敵人，並殺死德雷特納領主。', '$p，放輕鬆。深呼吸。\n\n<織夢者慢慢地深呼吸。>\n\n這裡情況緊迫，但不代表你要跟著緊張。\n\n一切都會沒事的。如果你不相信我，強大的艾利歐德樹林長和塔許莫爾樹林長應該能讓你放心。\n\n他們一起上山替我們開路，很快就能解決了。', '', '', '', '', '', '到持續增長的黑暗上方的橋找赫恩勛爵。', 39653),
(63970, 'zhTW', '一個靈魂都不能少', '用塞爾納斯的救援搖籃救出困在果戈亞的$3oa個迷失的德魯伊，把他們送回塞爾納斯的身邊。', '你聽見果戈亞傳出受困靈魂的呼喊了嗎？\n\n在我們面前的就是扭曲的靈魂之河，裡面充滿了受盡折磨的無辜受害者。\n\n我們英勇的德魯伊靈魂部隊進入河裡，希望能救出那些迷失的靈魂，但他們恐怕也跟著一起受困了。\n\n拿出你的勇氣，帶著我的搖籃進入河裡，把迷失的靈魂放在這個搖籃送回來給我。', '', '', '', '', '', '到持續增長的黑暗上方的橋找塞爾納斯。', 39653),
(63969, 'zhTW', '黑暗逼近', '收集$1oa本淵誓儀式之書、$2oa份淵誓書信碎片，和$3oa個黑暗骨髓。', '報告顯示有一大片詭異的黑暗壟罩著這一帶的上層，因此凜冬女王號召了一場狩獵行動。\n\n曠野獵者雖然勇敢但並不愚蠢。我們要在進攻前先摸透這片黑暗。\n\n搜查附近的敵人屍體來尋找線索。', '', '', '', '', '', '到持續增長的黑暗上方的橋找赫恩勛爵。', 39653),
(63964, 'zhTW', '仲介者的懸賞：恐爪', '從恐爪身上取得成熟的骨骸鳥喙。', '新大陸滿滿都是好機會。只要從名為恐爪的野獸身上取得完整的骨骸鳥喙，我們就會提供許多珍貴物品與你交換，歡迎有興趣的人前來洽詢。\n\n但如果你沒什麼膽識的話，還請別來浪費彼此的時間。\n\n請將這個樣本帶去給守衛者歇息地的塔那西。', '', '', '恐爪', '', '', '', 39653),
(63963, 'zhTW', '仲介者的懸賞：撕槌', '從撕槌身上取得厚刺獸皮。', '新大陸滿滿都是好機會。只要從名為撕槌的野獸身上取得厚刺獸皮，我們就會提供許多珍貴物品與你交換，歡迎有興趣的人前來洽詢。\n\n但如果你沒什麼膽識的話，還請別來浪費彼此的時間。\n\n請將這個樣本帶去給守衛者歇息地的塔那西。', '', '', '撕槌', '', '', '', 39653),
(63962, 'zhTW', '觀測紀錄', '從科西亞的重擊者瞰台那裡收集$1oa個觀測紀錄。', '你好啊，淵喉行者，你有空嗎？\n\n想必你已經知道了，我的商業集團已經偷偷在科西亞的各個地方部署了觀察裝置。但如果無法取回觀察裝置的資料，那麼再多的觀察裝置都是徒勞。這種時候就得靠你了。\n\n重擊者瞰台那邊的紀錄應該已經準備就緒了。你看不見裝置本身，但是相關的資料看起來會像是發亮的球體。\n\n把那些資料帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
(63961, 'zhTW', '封印的秘密', '從科西亞的重擊者瞰台那裡取回$1oa個密封容器。', '啊，科西亞。我們會發現什麼秘密呢？\n\n我的助理很拼命在工作，努力想要在這片荒涼的土地上找到各式各樣的有趣小物。但我可以跟你打包票，那都是一些不太重要的東西。\n\n他們會把收集而來的物品放在指定的投遞箱裡面，而那些物品現在就放在重擊者瞰台等人過去取回。別擔心，投遞箱上面有無法破解的封印，能夠保護內容物和運送員。\n\n把那些密封容器帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
(63960, 'zhTW', '觀測紀錄', '在科西亞的向風之巢和甦醒河口收集$1oa個觀測紀錄。', '你好啊，淵喉行者，你有空嗎？\n\n想必你已經知道了，我的商業集團已經偷偷在科西亞的各個地方部署了觀察裝置。但如果無法取回觀察裝置的資料，那麼再多的觀察裝置都是徒勞。這種時候就得靠你了。\n\n向風之巢和甦醒河口那邊的紀錄應該已經準備就緒了。你看不見裝置本身，但是相關的資料看起來會像是發亮的球體。\n\n也別忘記找找看地底下方！\n\n把那些資料帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
