(63956, 'zhTW', '封印的秘密', '從科西亞的向風之巢那裡取回$1oa個密封容器。', '啊，科西亞。我們會發現什麼秘密呢？\n\n我的助理很拼命在工作，努力想要在這片荒涼的土地上找到各式各樣的有趣小物。但我可以跟你打包票，那都是一些不太重要的東西。\n\n他們會把收集而來的物品放在指定的投遞箱裡面，現在那些物品正在向風之巢等人過去取回。別擔心，投遞箱上面有無法破解的封印，能夠保護內容物和運送員。\n\n把那些密封容器帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
