(63951, 'zhTW', '魔影之地', '使用失衡裂隙石進入裂隙，然後破壞裂隙帷幕陷阱，並救出$1a個隙縛沃爾凱。', '$p，存在並非易事，是由一層層現實堆疊交織而成。\n\n閻獄之主的陷阱不斷地把我方部隊一個個拉入裂隙之中，藏在正常視力看不見的地方。\n\n我這邊有一顆失衡裂隙石，這顆裂隙石能夠帶你進入裂隙、摧毀陷阱，然後趁我方部隊的戰鬥人員還沒有徹底迷失之前把他們解放出來。\n\n你摧毀裂隙帷幕陷阱之後，離開裂隙，記得把受困的士兵帶回我們的現實空間。', '', '', '', '', '', '到持續增長的黑暗上方的橋找藩侯辛丹。', 39653),
(63950, 'zhTW', '刃翼之爪', '收集$1oa個刃翼之爪。', '獵人對這片土地還不熟悉，但我們發現有兇猛的野獸棲息在此處。\n\n其中有一種生物名為刃翼，長有可怕利爪，是兇猛的掠食者，而且性格跟沃爾凱一樣暴躁。\n\n<赫恩咧嘴而笑。>\n\n帶一些刃翼之爪給我，我要拿來教導新來的獵人，讓他們知道有什麼樣的野獸在等著我們。', '', '', '', '', '', '', 39653),
(63949, 'zhTW', '塑造未來', '在科西亞和淵喉的各個地方完成誓盟進攻戰、完成每日任務、搜刮寶藏、殺死稀有生物和擊敗托迦司折磨者都可以阻撓閻獄之主的部隊。', '閻獄之主的力量和惡意日漸增強，因此我們也必須加強抵抗的能力。\n\n$n，跟盟友並肩作戰。擊退黑暗，不要讓黑暗有機會吞噬我們。\n\n如果能同心協力的話，或許還有一線生機。\n\n願使命指引你的雙手。', '', '', '', '', '', '', 39653),
(63944, 'zhTW', '前往科西亞', '前往科西亞的守衛者歇息地，向塔迦蘭回報。', '$n，做好準備。我們的盟友正在科西亞等待著你。', '', '', '', '', '', '', 39653),
(63936, 'zhTW', '被吞噬的靈魄', '從甦醒河口的吞噬者身上取回$1oa個被吞噬的靈魄。', '西卡有個主意！\n\n吞噬者……吞噬者什麼都吃！也會吃靈魄。\n\n如果從吞噬者那邊把靈魄搶過來，靈魄就是我們的了！', '', '', '', '', '', '', 39653),
(63935, 'zhTW', '寶貴樹根', '從科西亞的寶庫附近收集$1oa個殘餘靈魄。', '科西亞。這片土地的樹林遭受荼毒。\n\n但是即便遭到破壞，也還是有希望存在。\n\n收集靈魄，並重建樹林吧。', '', '', '', '', '', '', 39653),
(63934, 'zhTW', '攻擊郵件', '從學者居所那裡取回$1oa份遭竊的訊息。', '你好，凡人！\n\n我正在執行任務，要把訊息轉交給科西亞這個美麗國度的盟友，但是我沒辦法完成這個任務。\n\n我要遞送的訊息被淵誓者偷走了，而且他們還胡亂把這些訊息存放在各個不同的地方。\n\n你能夠幫我收集這些訊息，並帶回來給我嗎？這樣我才能把訊息交給正確的收件人。\n\n謝謝你！', '', '', '', '', '', '', 39653),
(63924, 'zhTW', '勾拉之爪塑像', '將勾拉之爪塑像帶去給緬懷聖庫的博文者羅述爾。', '<根據你對於博文者寶典的了解，你能夠確定這就是其中一個遺失的文物。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這個塑像。>', '', '', '', '', '', '', 39653),
