(63919, 'zhTW', '束縛之書：苦巫士', '收集$1oa個蒼藍書頁，然後帶去給緬懷聖庫的博文者羅述爾。', '<你聽見模糊的聲音從書本裡面傳出來，間或夾雜著靜電干擾般的雜音。大部分的話語都聽不清楚，但因為它不斷重複著同一段話，所以你勉強理解它希望你取回蒼藍色的書頁頁。\n\n翻開書本之後，你發現它確實少了許多張書頁。\n\n如果能找回遺失的書頁，就能把這本書帶回去給博文者，拼湊這本書的原貌。>', '', '', '', '', '', '', 39653),
