(63914, 'zhTW', '解譯晶石', '將解譯晶石帶去給緬懷聖庫的博文者羅述爾。', '<根據你對於博文者寶典的了解，你能夠確定這就是其中一個遺失的文物。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這件文物。>', '', '', '', '', '', '', 39653),
(63913, 'zhTW', '不穩定的爆炸球體', '將不穩定的爆炸球體帶去給緬懷聖庫的博文者羅述爾。', '<根據你對於博文者寶典的了解，你能夠確定這就是其中一個遺失的文物。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這個裝置。>', '', '', '', '', '', '', 39653),
(63912, 'zhTW', '暗影之境星象圖', '收集$1oa個死後世界導航研究卷軸，然後帶去給緬懷聖庫的博文者羅述爾。', '<你發現自己曾經在博文者寶典看過一樣的文物。\n\n淵誓者將其丟棄，大概是因為他們認為這個東西一點用處都沒有。\n\n只有這個星象圖確實無用，如果沒有相應的座標資料能夠參考的話，根本就無法在暗影之境的死後世界中找出相對位置。如果能夠從死去的學者身上找到研究資料，就能夠恢復這張圖表的作用、並且帶回去給博文者。>', '', '', '', '', '', '', 39653),
(63911, 'zhTW', '歌唱的鋼錠', '擊敗淵誓入侵者，然後將歌唱的鋼錠帶去給緬懷聖庫的博文者羅述爾。', '<金屬錠發出哀號，產生高低起伏的振音。>\n\n真慘！這群流氓毫不留情地拿著錘子對我一頓毒打，恣意改造我的體態，藉此滿足他們的私利。\n\n可恨！那些傢伙真可恨。\n\n<金屬錠發出高亢的戰吼聲。>\n\n換這些淵誓者嚐嚐被錘打的滋味吧！', '', '', '', '', '', '', 39653),
(63910, 'zhTW', '虛空之星', '替虛空之星充能，然後帶去給緬懷聖庫的博文者羅述爾。', '<你發現自己曾經在博文者寶典那邊看過一樣的文物。\n\n能量來源幾乎枯竭了，不過只要接觸沒有經過過濾的原生靈魄，就能夠恢復能量。利用附近的裂隙應該就能辦到。>', '', '', '', '', '', '', 39653),
(63909, 'zhTW', '變形者面罩', '將變形者面罩帶去給緬懷聖庫的博文者羅述爾。', '<根據你對於博文者寶典的了解，你能夠確定這就是其中一個遺失的文物。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這個面具。>', '', '', '', '', '', '', 39653),
(63908, 'zhTW', '神性意圖壁壘', '將神性意圖壁壘帶去給緬懷聖庫的博文者羅述爾。', '<根據你對於博文者寶典的了解，你能夠確定這就是其中一個遺失的文物。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這面盾牌。>', '', '', '', '', '', '', 39653),
(63904, 'zhTW', '亞登曠野之心', '調查森林之心。', '我把我的符印藏在森林之心，避免讓淵喉的爪牙得逞。\n\n但號角卻發出了求援的呼喚。\n\n我需要你和你的盟友前去看看發生什麼事。', '', '', '', '', '', '到森林之心外面找凜冬女王。', 39653),
(63903, 'zhTW', '猛攻聖所', '在統御聖所擊敗希瓦娜斯‧風行者。', '閻獄之主握有四大誓盟的符印。他顯然打算逃出淵喉，並從奧睿博司竊取審斷者的符印。\n\n我們絕不能容許這種事發生。\n\n統御聖所坐落在托迦司的頂端，也就是閻獄之主的大本營。時機已然成熟，我們要進入這個黑暗的領域。\n\n想必希瓦娜斯‧風行者會負責指揮部隊來阻撓我們。我們必須打敗她…並把安杜因‧烏瑞恩從她的魔掌中拯救出來。\n\n$n，召集你的部隊。黯刃騎士團會與你同在。', '', '女妖之王是閻獄之主計畫的關鍵。找到她…然後阻止她。', '希瓦娜斯‧風行者', '', '', '', 39653),
(63902, 'zhTW', '各位，好消息！', '跟丹妮卡一起飛到科西亞，把消息告知伯瓦爾。', '來吧，朋友。我們離開這個糟糕的地方。\n\n你的同伴一定都迫不及待想知道獄主之眼被擊敗的消息。我會帶你去找他們。\n\n$n，等你準備好出發就跟我說一聲。', '', '', '', '', '', '', 39653),
(63901, 'zhTW', '專注眼睛', '去終站平台使用伊斯卡號角召喚歐丁之怒。', '你所收集到的悲傷與憤怒足夠滿足你的目標。應該吧。\n\n如果你還是堅持要做這件傻事，就到終站平台使用號角吧。那是靈魂之河向上流至托迦司的地方。那個地方確實蘊藏著強大的能量。\n\n你那些金光閃閃的盟友，應該會吸引到閻獄之主的注意力。你最好別死在那裡。不然就太浪費我的心血了。', '', '獄主之眼在淵喉搜尋著閻獄之主的敵人。', '獄主之眼', '', '', '', 39653),
(63899, 'zhTW', '束縛之書：瘋女巫', '收集$1oa個赤紅書頁，然後帶去給緬懷聖庫的博文者羅述爾。', '<你聽見模糊的聲音從書本裡面傳出來，間或夾雜著靜電干擾般的雜音。大部分的話語都聽不清楚，但因為它不斷重複著同一段話，所以你勉強理解它希望你取回赤紅色的書頁。\n\n翻開書本之後，你發現它確實少了許多張書頁。\n\n如果能找回遺失的書頁，就能把這本書帶回去給博文者，拼湊這本書的原貌。>', '', '', '', '', '', '', 39653),
(63896, 'zhTW', '遭譴者之淚', '從果戈亞：靈魂之河收集$1oa滴遭譴者之淚。', '如果要在淵喉安置樂器並讓它發揮你所預期的效果，就必須為其注入最真實的痛苦，也就是被囚禁在這個監牢中的悲慘靈魂所切身感受到的痛苦。\n\n這個地方到處都充斥著悲傷，因此應該不難收集痛苦。你只需要前往果戈亞即可。受詛咒的靈魂所流下的大量淚水會化成悲傷結晶，並隨著靈魂之河漂走。\n\n小心別被靈魂的悲傷給淹沒了。', '', '', '', '', '', '將遭譴者之淚帶到果戈亞的邊緣交給維娜里的影像。', 39653),
(63895, 'zhTW', '百寶袋', '測試維娜里的包包裡面的傳送裝置。', '真是有趣，聽覺序列和靈體披風。$n，你幫我把這些東西拿好，我感覺它們之後會派上用場。\n\n啊，還有個我專屬的特殊物品。如果我沒猜錯的話…我也很少猜錯，這確實是投影裝置。這個東西可好用了！\n\n這是什麼呢？是個類似傳送裝置的東西。我們應該立刻開始進行測試。\n\n雖然我說「我們」，但我的意思是「你」。', '', '', '', '', '', '', 39653),
(63892, 'zhTW', '預言師的符文字牌', '收集$1oa個符文字牌，然後帶去給緬懷聖庫的博文者羅述爾。', '<袋子裡面只有一個符文字牌。這個符文字牌自動旋轉翻動起來，彷彿有一隻看不見的手在撥弄它。\n\n石板上面刻著精美的符文，讓人有點聯想到維酷人的語言。根據字牌背後的圖案來看，應該還有其他類似的字牌可以組成一套。>', '', '', '', '', '', '', 39653),
(63867, 'zhTW', '憤怒掌控', '在靈魂之河使用虹吸裝置吸取狂怒魔影的怒氣。', '我並不是音樂家，但我花了不少時間在塔札維許欣賞表演。\n\n我們必須收集強烈的情感才能讓這個號角發出聲音。\n\n落入靈魂之河的悲慘靈魂，心中的怒火熊熊燃燒。使用虹吸裝置吸取這些狂怒魔影的怒氣，並將怒氣灌入樂器裡。\n\n你收集來的憤怒狂嘯，聲音應該足以穿透淵喉並抵達盟友身邊。\n\n但是我想那個曲調應該不會太動聽。', '', '', '', '', '', '在靈魂之河的邊緣地帶找到維娜里的投影。', 39653),
(63864, 'zhTW', '可怕混合物', '滅掉$2oa個易燃的餘燼火花。', '墓土和點畫草調和出來的味道令人不敢恭維，但塔賓斯卻使用這種原料製作出了大量的茶葉。\n\n味道噁心極了，我直接把整壺茶都給倒進了火焰裡面。結果我發現這種茶葉非常濕潤，很適合用來作為滅火的手段！\n\n塔賓斯會負責搬運整批茶葉跟你一起行動。請好好利用，把茶葉扔在佐瓦爾的大釜附近那些易燃的餘燼火花上面。', '', '', '', '', '', '', 39653),
(63863, 'zhTW', '眾志成城', '擊敗瑪菲特斯、多摩努斯和弗里斯。', '內梅雅和我雖然處於一種競爭的關係，但是當我們面臨到更巨大的威脅時，還是可以盡釋前嫌攜手合作。獅群和芬連克斯都是戰場上的兇猛鬥士。\n\n能夠在接下來的戰鬥中協助你，是我們兩個人的榮幸。\n\n請讓安狄拉或迦塔馬托斯協助你擊敗閻獄之主的勇士，除掉威脅著我方部隊的憂患。', '', '', '', '', '', '', 39653),
(63861, 'zhTW', '開始收集', '在緬懷聖庫替博文者羅述爾找回記憶秘典。', '我們得繼續努力，首先要尋回學術研究所需的重要物品「失落秘典」。\n\n這會花上一點時間，但隨著我們的努力，這個秘典的書頁會不斷成長茁壯，就像科西亞過去這數百萬年以來不斷繁榮昌盛一樣。\n\n至於秘典的所在地點，它原本位於南邊的冥想洞窟，深埋在科西亞的地底深處。\n\n但願閻獄之主的爪牙還沒有找到那個秘典。', '', '', '', '', '', '', 39653),
(63860, 'zhTW', '恆世學者咒符', '把受損的咒符帶去緬懷聖庫交給博文者羅述爾。', '<這個咒符上面有凹痕，而且沾滿了淤泥。不曉得是誰把這個咒符放在這裡的，但對方肯定很粗魯。\n\n博文者羅述爾在緬懷聖庫有個地方可以存放這個咒符。>', '', '', '', '', '', '', 39653),
(63857, 'zhTW', '永恆者之聲', '聽取計畫。', '<伯瓦爾定睛注視著眼前的莊嚴人物，以及往無限遠方延伸的無數傳送通道。>\n\n這個地方…太奇妙了。\n\n但現在可沒空發楞。榮耀之聲必須立刻開始進行這場會議。', '', '', '', '', '', '回到奧睿博司的政要區。', 39653),
(63856, 'zhTW', '誓盟雲集', '與塔因納拉交談進入審斷者殿堂。', '雖然閻獄之主目前還被困在淵喉裡面，但他殘忍的行徑已經染指外界。\n\n好消息是，受傷的御靈者正在恢復當中。但是我聽說她的傷口…有種不祥的特性。\n\n永恆者和他們的盟友在審斷者殿堂等待著你和大領主弗塔根。我會助你前往。\n\n我謹代表她的聲音。', '', '', '', '', '', '', 39653),
(63855, 'zhTW', '方便通行', '在科西亞和維娜里避難所之間建立連結。', '科西亞處處充滿機會。你看這些耐人尋味的東西。\n\n我預料到會有這些奇妙的物品，所以我有備而來。我們找個合適的地點，在那裡和我的避難所之間建立更持久穩固的連結。\n\n我們的合作關係還會繼續。', '', '', '', '', '', '', 39653),
(63853, 'zhTW', '殺死火焰', '幫希奧塔殺死『無窮者』伊特努司。', '你看到了嗎？\n\n在我眼角餘光的地方，那個東西總是陰魂不散…散發出如此耀眼的光芒！\n\n那個冒著火焰與灰燼的傢伙遲遲不肯離去，這樣子我怎麼放鬆享受一杯茶的悠閒時光呢？\n\n拜託了，淵喉行者，幫我一個忙…弄走那個東西，這樣大家就可以一起享用我最喜歡的茶點了！', '', '這裡的火焰永不熄滅，就跟佐瓦爾的大釜那些熔爐一樣。', '『無窮者』伊特努司', '', '', '', 39653),
(63849, 'zhTW', '助聽器', '將聽覺序列安裝在德司莫泰隆，讓維娜里竊聽當地的居民。', '太幸運了！你正好被傳送到我…有興趣的地方。安裝我給你的聽覺序列，我會建立可用的訊號。\n\n在這種危險的地方一定要非常謹慎。你得用上靈體披風，才不會被發現。', '', '', '', '', '', '', 39653),
(63848, 'zhTW', '感謝之意', '到科西亞的守衛者歇息地與維娜里交談。', '淵喉行者，你的出現印證了一個古老的預言。我相信你和你的盟友會拯救我們。\n\n或許我太快對你的仲介者朋友下了判斷。畢竟是她護送你到科西亞的。\n\n請代我們向維娜里表示感謝，讓她知道我們很樂意回答她的問題。\n\n她…看起來好像有很多問題要問的樣子。', '', '', '', '', '', '', 39653),
(63845, 'zhTW', '歐丁之怒', '親眼目睹被選中的華爾琪受到強化，以及伊斯卡號角的連結過程。', '號角鍛造完工，你也挑選出了夠格的戰士。\n\n$n，接下來只要讓選中的華爾琪跟號角相連，然後注入我的力量，他們就能夠使用我的憤怒發動攻擊。\n\n來吧，親眼目睹這一切。', '', '', '', '', '', '', 39653),
(63844, 'zhTW', '被選中的少數人', '前往榮耀之環，與華爾琪戰鬥，判斷哪些人最具備資格。', '我需要更多華爾琪與丹妮卡一起參加接下來的戰鬥。$n，我要讓你挑選誰最有資格上戰場。\n\n去參加榮耀之環的挑戰。最堅強的戰士都會出席。$c，努力奮戰吧，帶給你的武器榮耀。', '', '', '', '', '', '', 39653),
(63842, 'zhTW', '好一招把戲', '到鍊魂塔把15個敵人縮小，並讓$2oa隻淵喉污鼠變大來吃掉他們！', '我要被那些殘暴的折磨者氣瘋了…\n\n閻獄之主的走狗虐待那些被冤枉送來這裡的好靈魂，因為這裡沒人敢站出來對抗他們！\n\n不過，現在我來了，而且我有個好計畫能讓他們付出代價。\n\n怎麼樣？想幫我讓那些霸凌者嚐嚐被霸凌的滋味嗎？', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63840, 'zhTW', '快快長大', '餵食小果姆屍體讓牠長大，並騎著牠邁向勝利！', '我知道你在想什麼，別擔心，這些小果姆完全在我的掌控之下！\n\n我在汎希爾的餘燼宴會裡學到了一兩招控制這些小搗蛋的技巧。\n\n如果想用牠們的力量來戰鬥的話，我的法杖可以借你。你可以用法杖選一隻你要的小果姆，然後命令牠吃敵人的屍體，牠就會長大變強壯。\n\n不會很麻煩，小果姆長很快的。', '', '', '', '', '', '在鍊魂塔的果姆獸欄與雷頓碰面。', 39653),
(63839, 'zhTW', '萬中選一', '檢視鍊魂塔裡拙劣的靈魂，直到找到一個真正可敬的靈魂。', '我親眼看見可敬的靈魂在冤枉之下送進淵喉。\n\n就連葛雷希特也差點被宮務大臣的手下送進去。但在我的照料下，他完全證明了自己是夠資格的。\n\n檢視那些被閻獄之主的走狗視為「拙劣」的靈魂，並確保他們的確該受到善待。\n\n就算檢視完鍊魂塔裡的所有靈魂後，只找到一個應該要帶回瑞文崔斯的可敬靈魂，那也是值得的。', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63837, 'zhTW', '萬能好茶', '幫塔賓斯和佳賓斯把茶交給鍊魂塔的$2oa名盟友。', '親愛的$p！我就知道你終究會來幫我們解悶！\n\n我才在跟妮亞說，你之前用茶的治癒能力把我從餘燼區救了出來！\n\n她有點半信半疑，或許你可以幫塔賓斯和佳賓斯的忙，讓她了解茶是多麼萬能的東西！', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63836, 'zhTW', '牙碎的粉絲團', '殺死被牙碎從傳送門中拉出來的$1oa個托迦司敵人。', '牙碎是我所看過最強壯的泥掘者！他真是太厲害了！\n\n他負責守在巨大的托迦司傳送門那邊，把壞蛋從他們的老巢裡面給抓出來！\n\n對方甚至連自己是怎麼死的都不知道，哈哈！\n\n我和棍臉一來到這裡，馬上就加入了他的那個俱樂部。\n\n你要加入嗎？如果你想要加入的話，還得按規矩來：你得先到傳送門那邊，然後打敗他從傳送門裡面抓出來的壞蛋才行！', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63835, 'zhTW', '派對使者之怒', '協助派對使者特梅爾，朝鍊魂塔的$2oa名敵人投擲劇毒炸彈。', '喔，你這麼快就回來啦，$p！\n\n…還是我們還沒見過面？有時候還真沒什麼印象…\n\n總之，你應該有好好進行墓穴守衛者凱希爾削弱敵人的計畫吧。\n\n詳細計畫我想不起來了，但我確定跟特梅爾有關。聽說他最近喜歡自稱為「派對使者」…\n\n<監管者短暫地望向你的後方。>\n\n「派對使者」…看來我離開瑞文崔斯太久了。', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63834, 'zhTW', '鍊魂塔武器', '收集$1oa把淵誓者武器、$2oa個恐怖皇冠，和$3oa個魔影之眼。', '罪殞城的汎希爾人不會浪費靈魂，而他們的石源魔也不會浪費武裝。\n\n取回敵人的工具，讓我們的軍隊加以轉化利用。', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63833, 'zhTW', '鍊魂塔之亂', '在鍊魂塔殺死$1oa個敵人。', '我相信我的夥伴和將軍有更明確的任務要交給你。\n\n但我的請求比較簡單。現在我們四周都是敵人。\n\n去擊退他們，讓我們有更多空間可以行動。', '', '', '', '', '', '到鍊魂塔樓梯下找潛藏的雷納瑟王子。', 39653),
(63831, 'zhTW', '憤怒吼聲', '協助歐丁熔爐的大鐵匠黑爾加。', '我會透過無情的怒火來替遭到攻擊的華爾琪報仇！\n\n$c，你在這件事情中扮演著重要的角色。你必須卯足你今天所展示出來的勇氣，將我的眼睛引導到戰場上。\n\n但首先是另一個比較簡單的任務…幫我製作能夠召喚憤怒的號角。大鐵匠黑爾加會引導你的。', '', '', '', '', '', '', 39653),
(63829, 'zhTW', '不會拋下任何人', '拯救$1oa個受困的志士', '現在是個大好機會，我們可以拯救那些我們以為再也回不來的同胞！\n\n許多志士被閻獄之主抓住，被迫加入他的軍隊。膽敢反抗的志士都被關進飄在空中的牢籠裡面，等待他們的靈魂崩潰的那一刻到來。\n\n破壞統御鎖鏈，並把受困的志士從牢籠裡面拯救出來。', '', '', '', '', '', '', 39653),
(63827, 'zhTW', '激勵的話語', '對$1oa個精疲力盡的保衛者朗誦寶典裡面的文字。', '我方部隊已經奮力戰鬥持續了好幾個小時。想必他們已經疲憊不堪、士氣低靡。\n\n帶著這個寶典，並朗誦其中的文字給我方部隊聆聽。務必要謹記一件事。雖然這些文字看似無法理解且毫無意義，但它們其實蘊藏著強大的力量。\n\n將這些文字朗誦給筋疲力盡的保衛者聆聽，他們就會重振希望。', '', '', '', '', '', '', 39653),
(63824, 'zhTW', '琪瑞安進攻戰', '在墮滅堡和寂滅之面完成$1oa個任務。', '我們的攻擊行動把閻獄之主的爪牙打了個措手不及。我們要攻破墮滅堡，然後在統御祭壇擊敗他的勇士！\n\n淵喉行者，我們需要你的幫忙。去戰場上支援我們的部隊吧！', '', '', '', '', '', '', 39653),
(63823, 'zhTW', '暗夜妖精進攻戰', '在墮滅堡和寂滅之面完成$1oa個任務。', '我們的攻擊行動把閻獄之主的爪牙打了個措手不及。我們要攻破墮滅堡，然後在統御祭壇擊敗他的勇士！\n\n淵喉行者，我們需要你的幫忙。去戰場上支援我們的部隊吧！', '', '', '', '', '', '', 39653),
(63822, 'zhTW', '汎希爾進攻戰', '', '', '', '', '', '', '', '', 39653),
(63811, 'zhTW', '冤家路窄', '陪伴丹妮卡前往大宴廳，將黑爾雅的惡行告訴歐丁。', '我的第一位姊妹失蹤時，我們開始擔心。出發找她的人都沒有回來。無一例外。\n\n這裡的發現證明我們遭到曾經信任的人背叛。\n\n來吧，我們要告訴歐丁我們在淵喉看見的事情。\n\n他的憤怒將難以匹敵。', '', '', '', '', '', '', 39653),
(63810, 'zhTW', '同族之鳥', '跟著金黃羽毛的蹤跡走，找到是什麼東西掉落的。', '我在淵喉見過許多黯翼，但從來沒有看過金光閃閃的黯翼。\n\n現在聽覺序列能夠穩定地轉傳資訊了，我們應該去尋找這些羽毛的來源。\n\n淵喉行者，循著蹤跡走。這個地方有某個秘密…而且很有可能有利可圖。\n\n在你的故鄉，黃金是具有價值的，對吧？', '', '', '', '', '', '', 39653),
(63794, 'zhTW', '仲介者的賞金：飢餓巨怪', '從飢餓巨怪身上取回大量吞噬者之血。', '新大陸滿滿都是好機會。有興趣的人照過來，只要把大量吞噬者之血拿來給我們，巨大吞噬者的血尤佳，我們就會提供許多珍貴物品跟你交換。\n\n但如果你沒什麼膽識的話，還請別來浪費彼此的時間。\n\n請將這個樣本帶去給守衛者歇息地的塔那西。', '', '', '飢餓巨怪', '', '', '', 39653),
(63793, 'zhTW', '仲介者的賞金：『污衊者』安席迪斯', '擊敗『污衊者』安席迪斯。', '長著翅膀、名為『污衊者』安席迪斯的淵誓者在科西亞妨礙商業集團的行動。\n\n只要消滅掉這個邪惡的傢伙，我必有重賞。\n\n但請小心謹慎，安席迪斯是個強大的對手，你可能需要找幾個盟友才有辦法擊敗他。', '', '', '『污衊者』安席迪斯', '', '', '', 39653),
(63792, 'zhTW', '仲介者的賞金：『壞滅者』諾克圖諾斯', '擊敗『壞滅者』諾克圖諾斯。', '某個惡名昭彰、名為『壞滅者』諾克圖諾斯的淵喉魔導師在科西亞妨礙商業集團的行動。\n\n只要消滅掉這個邪惡的傢伙，我必有重賞。\n\n但請小心謹慎，諾克圖諾斯是個強大的對手，你可能需要找幾個盟友才有辦法擊敗他。', '', '', '『壞滅者』諾克圖諾斯', '', '', '', 39653),
(63791, 'zhTW', '仲介者的賞金：『咒誕』瓦爾迪納', '擊敗『咒誕』瓦爾迪納。', '身上穿著尖刺護甲、名為『咒誕』瓦爾迪納的淵誓者在科西亞妨礙商業集團的行動。\n\n只要消滅掉這個邪惡的傢伙，我必有重賞。\n\n但請小心謹慎，瓦爾迪納是個強大的對手，你可能需要找幾個盟友才有辦法擊敗他。', '', '', '『咒誕』瓦爾迪納', '', '', '', 39653),
(63790, 'zhTW', '仲介者的賞金：阿佐拉克領主', '擊敗阿佐拉克領主。', '某個名為阿佐拉克領主的強大驚懼領主在科西亞妨礙商業集團的行動。\n\n只要消滅掉這個邪惡的傢伙，我必有重賞。\n\n請小心謹慎，阿佐拉克是個強大的對手，你可能需要找幾個盟友一起才有辦法殺掉他。', '', '', '阿佐拉克領主', '', '', '', 39653),
(63789, 'zhTW', '持續抗戰：學者居所', '清除學者居所的淵誓者。', '我們不能讓淵誓者在距離我們營地這麼近的地方設立據點。雖然侍從告訴我這個地方尋常人是看不見的，但是我看得見敵人，在這種情況下我完全沒辦法安心。\n\n進入學者居所，清除裡面的閻獄之主爪牙。', '', '', '', '', '', '', 39653),
(63788, 'zhTW', '持續抗戰：指引聖堂', '清除指引聖堂裡面的吞噬者。', '閻獄之主摧毀了侍從的家園，我們可以在他們最困頓的時期對他們伸出援手。\n\n指引聖堂就在附近。侍從對於那個聖堂充滿敬意，卻也充滿哀傷。那個聖堂是侍從禱告和追求真理的地方。但是現在聖堂裡面到處都是吞噬者。\n\n清除吞噬者，讓侍從能夠回到聖堂舉行儀式、禱告並尋求慰藉。', '', '', '', '', '', '', 39653),
(63787, 'zhTW', '持續抗戰：重擊者瞰台', '掃除重擊者瞰台的晶皮熊。', '我觀察到，連通淵喉和科西亞的新道路就位於重擊者瞰台附近，那個地方有很重要的戰略價值。\n\n不幸的是，那個地方到處都是晶皮熊。\n\n如果我們能夠佔領那個地方，那麼不只確保一條通往西邊的道路，也會有一個據點可以監視閻獄之主的部隊。', '', '', '', '', '', '', 39653),
(63786, 'zhTW', '掃蕩向風之巢', '前往向風之巢，清除那個區域的敵對生物。', '科西亞的上空是個危險的地方。\n\n不只有淵誓者會攻擊我方部隊，原本就生活在這裡的生物也是個威脅。我們必須確保空域的安全，保護在空中飛行的盟友和野獸。\n\n當地的飛行野獸都來自於向風之巢。去那個地方掃除有攻擊性的飛行生物吧。\n\n事成之後，我們就能掌握空中優勢了。', '', '', '', '', '', '', 39653),
(63785, 'zhTW', '持續抗戰：追尋者議會', '在科西亞的追尋者議會驅離閻獄之主的爪牙。', '佐瓦爾部隊的攻勢仍未停止，他們持續蹂躪著這片土地。\n\n我們必須讓他們知道厲害。$n，讓他們知道我們絕對不會退縮。\n\n亞登曠野之力與你同在。', '', '', '', '', '', '', 39653),
(63784, 'zhTW', '金色不明物', '帶回$1oa個土黃哥羅米。', '$p！最近過得還好嗎？\n\n我們聽說最近有很多有趣的事情發生。\n\n你看到那些鬼鬼祟祟的跳獸了嗎？它們的行動真難以捉摸，你說是吧？就某種程度上來說，我和我的兄弟需要它們身上的閃亮亮毛皮來隱匿行蹤。你懂的，別讓強大敵人發現之類。\n\n我需要你幫我抓好幾隻跳獸過來。錢不是問題，把那些小小害蟲給我活捉過來就對了。', '', '', '', '', '', '', 39653),
(63783, 'zhTW', '取回靈魄', '從指引聖堂的吞噬者身上取回$1oa個被吞噬的靈魄。', '我們需要源源不絕的戰鬥人員、補給品和靈魄，才有辦法繼續努力下去。其中，靈魄最難以取得，原因想必不用我多說了。不過，我懂得如何變通。\n\n附近有個充沛的靈魄來源。也就是目前充斥在指引聖堂的吞噬者。雖然說用暴力強行取出靈魄並不是件容易的事情，但這麼做確實很有效。前提是你夠強。你辦得到嗎？', '', '', '', '', '', '', 39653),
(63782, 'zhTW', '淵誓儀式', '收集$1oa個淵誓魔典。', '淵誓者的部隊之中有許多懂得駕馭魔法的施法者。我們對這種魔法一無所知，因此我們的處境也變得特別危險。\n\n我們必須釐清對方的能耐，這樣子才能夠做好防禦的準備。我個人對於敵人所採取的手段與儀式的好奇心擺在其次。\n\n獵殺這些低劣的施法者，並將對方的魔典帶回來給我。', '', '', '', '', '', '', 39653),
(63781, 'zhTW', '淵誓戰鬥計畫', '取回淵誓者戰鬥計畫。', '你覺得哪一種做法對敵人的損害更大？是摧毀敵軍的部隊呢？還是中斷對方的通訊？\n\n中斷通訊還有另一個好處，那就是能讓你將我方部隊安排在絕佳的位置伏擊敵方的援軍。\n\n看來你已經知道答案了。有個淵誓中尉沃西費魯斯準備要從淵喉來到科西亞這裡，對方會走北方那條道路。找出來，然後殺死對方，記得順便把敵人的戰鬥計畫帶回來。', '', '這個威風的將軍在淵喉與科西亞之間運送淵誓者戰鬥計畫。', '沃西費魯斯中尉', '', '', '', 39653),
(63780, 'zhTW', '以牙還牙！', '收集$1oa個淵誓紋章。', '光是想到閻獄之主爪牙闖入亞登曠野的惡劣行徑，就令人髮指！\n\n我這個人向來有仇必報。\n\n或是請別人幫我報仇！去殺死那些淵誓者，把他們身上的紋章帶回來給我，讓我看看你殺掉了幾個人。\n\n我不在乎你透過什麼手段拿到那些紋章，反正只要是來自那些來自淵喉的王八蛋身上都可以！', '', '', '', '', '', '', 39653),
(63779, 'zhTW', '正常的表象', '收集$1oa個聖壇祭品。', '$p，我們必須幫助科西亞的侍從。他們頓時之間失去了幾乎所有的一切。\n\n他們原本負責在附近的指引聖堂拿取祭品放在聖壇。自從淵誓者入侵以來，他們一直無法進入聖堂，也沒辦法取回珍貴的祭品。\n\n希望你能夠幫忙把那些祭品拿回來。這樣子侍從說不定有機會稍微恢復到以前正常的生活。', '', '', '', '', '', '', 39653),
(63777, 'zhTW', '封印的秘密', '從學者居所那裡取回$1oa個密封容器。', '啊，科西亞。我們會發現什麼秘密呢？\n\n我的助理很拼命在工作，努力想要在這片荒涼的土地上找到各式各樣的有趣小物。但我可以跟你打包票，那都是一些不太重要的東西。\n\n他們會把收集而來的物品放在指定的投遞箱裡面，現在那些物品正在學者居所等人過去取回。別擔心，投遞箱上面有無法破解的封印，能夠保護內容物和運送員。\n\n把那些密封容器帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
(63776, 'zhTW', '觀測紀錄', '從學者居所那裡收集$1oa個觀測紀錄。', '你好啊，淵喉行者，你有空嗎？\n\n想必你已經知道了，我的商業集團已經偷偷在科西亞的各個地方部署了觀察裝置。但如果無法取回觀察裝置的資料，那麼再多的觀察裝置都是徒勞。這種時候就得靠你了。\n\n學者居所那邊的紀錄應該已經準備就緒了。你看不見裝置本身，但是相關的資料看起來會像是發亮的球體。\n\n也別忘了多留意地底下的洞穴！\n\n把那些資料帶回來給我，我就會給你優渥的獎勵。', '', '', '', '', '', '', 39653),
(63775, 'zhTW', '密文與鑰匙', '在寶庫和追尋者議會外面取回$1oa個失竊的解碼器。', '科西亞境內的資料庫有好幾層安全機制，這一定有什麼原因。\n\n每個寶庫都需要由解碼器來破解並解除屏障。我找不到更合適的詞語來形容，但暫且就說是解開各種秘密的鑰匙吧。\n\n在寶庫外面尋找被淵誓者偷走的解碼器，並帶回來給我。如此一來，我會好好保管這些解碼器，不讓任何人有機會知道其中的秘密。', '', '', '', '', '', '', 39653),
(63774, 'zhTW', '屍體多到難以選擇', '把$1oa個脫離肉體的靈魂帶去給前線縫補師，對方會負責打造出新的軀體給大家使用。', '$p，看看我們的四周。所到之處，屍體皆堆積如山。脫離肉體的靈魂已經等不及要重返戰場了。\n\n這就是我們扭轉戰局的籌碼。\n\n在戰場的各個地方召集脫離肉體的靈魂，並把他們帶去屍體堆交給我的縫補師，他們會負責打造出新的軀體給大家使用！', '', '', '', '', '', '回去找德拉卡女爵。', 39653),
(63773, 'zhTW', '你和你的軍隊', '選擇一名勇士，消滅$7oa個淵鎖狂怒者和$8oa個淵鎖破壞者。', '閻獄之主派出了精英部隊，想要打擊我軍的後方陣線。對方的這個計畫威脅到了我們的攻擊行動！\n\n我需要你和另一位士兵前去消滅敵方攻擊部隊。$n，瑪卓薩斯的五大家族都各有一位志願者主動提出想要協助你的請求。\n\n挑選其中一人，賦予他跟你並肩作戰的殊榮。', '', '', '', '', '', '告訴德拉卡女爵你成功了。', 39653),
(63772, 'zhTW', '在側翼等待', '在墮滅堡南方大門的外面協助阿特米德和琪瑞安部隊。', '琪瑞安的部隊已經抵達戰場並開始協助我方進攻。他們成功確保了我軍側翼的安全，並開始圍攻墮滅堡的南方大門。\n\n向阿特米德回報，並盡你所能協助琪瑞安！', '', '', '', '', '', '', 39653),
(63764, 'zhTW', '飛向天空', '跟丹妮卡飛到擎天堡的歐丁的大廳。', '姊妹的死讓我悲痛，我想要替她們報仇的心情幾乎無法抑止。但我知道自己不是女巫的魔法和淵誓大軍的對手。\n\n我們必須謹慎，先飛離這裡。\n\n雖然囚禁讓我變得虛弱，但我還有足夠的力量可以帶你離開。\n\n朋友，我們走吧。', '', '', '', '', '', '', 39653),
(63763, 'zhTW', '人人皆可疑', '把阿佐迪奧斯的頭帶給在守衛者歇息地的伯瓦爾‧弗塔根。', '<驚懼領主阿佐迪奧斯還微溫的頭顱怒目瞪視著你。\n\n我們應該讓守衛者歇息地的侍從知道述命者被綁架的消息。\n\n大領主弗塔根必定會想要知道這個意料之外的威脅。>', '', '', '', '', '', '把頭顱帶去守衛者歇息地交給伯瓦爾‧弗塔根。', 39653),
(63762, 'zhTW', '揭開幻象', '用述命者的用具來驅散幻象。', '述命者收集到必要的物品，能夠在這個房間中製造出幻象。好消息是，我們可以利用他自己的用具來驅散幻象，然後把他找出來。\n\n等他看到友善的面孔時，一定會很開心。\n\n不得不說，你在這次的任務裡幫了大忙。沒有你，我是絕對辦不到的。', '', '', '', '', '', '', 39653),
(63761, 'zhTW', '遲來的復仇', '在指引聖堂殺死$1oa個吞噬者。', '<科西亞保衛者身受重傷，連說話都很吃力。>\n\n吞噬者…大批湧入聖堂，我們寡不敵眾…\n\n我的任務…還沒完成。\n\n使命…我…\n\n<保衛者的聲音越來越微弱。>', '', '', '', '', '', '', 39653),
(63760, 'zhTW', '命運的回音', '在指引聖堂的聖壇讓述命者的用具產生共鳴。', '這裡到處都是吞噬者，但我們必須繼續尋找述命者。\n\n在這裡祭拜的侍從會在聖壇留下靈魄祭品。\n\n如果述命者在附近，你找到的用具會產生共鳴。希望這能幫助我們知道他的下落。', '', '', '', '', '', '', 39653),
(63759, 'zhTW', '改變搜尋方向', '到科西亞的指引聖堂入口找管理員卡坦恩。', '我認為述命者應該是往指引聖堂的方向去了，那裡對科西亞的侍從來說，是個神聖的場所。\n\n好消息是，因為你有隨手撿垃圾的習慣，所以我們手上握有述命者的用具！\n\n這個物品應該能夠幫助我們找出他的下落，不過我們得先處理聖堂的問題。', '', '', '', '', '', '到科西亞的指引聖堂入口找管理員卡坦恩。', 39653),
(63758, 'zhTW', '被遺漏的地方', '在追尋者議會尋找失蹤的述命者。', '我來這裡是希望能找到述命者或是一些關於他的下落的線索。\n\n物證顯示他來過這裡，也撐過了淵誓者的攻擊。位於廢墟另一頭的冥想室是我唯一還沒找的地方。\n\n要我單獨再回到追尋者議會太危險了。你可以幫我這個忙嗎？\n\n我一定要找到述命者，這件事非常重要。', '', '', '', '', '', '', 39653),
(63757, 'zhTW', '竊取掠奪者', '從淵誓者身上取回$1oa個科西亞古文物。', '<淵誓者身上攜帶著某個科西亞的古文物。\n\n你並不清楚敵人為什麼會想要這種古文物，但是你猜想守衛者歇息地的侍從應該會希望取回這件文物。>', '', '', '', '', '', '', 39653),
(63756, 'zhTW', '免受折磨', '從追尋者議會救出$1oa名受折磨的侍從。', '淵誓者不只屠殺他們在追尋者議會找到的人，他們也在審問生存者。\n\n我們要盡可能地救出生存者，他們可能知道述命者的下落。', '', '', '', '', '', '', 39653),
(63755, 'zhTW', '緊急事件', '尋找科西亞述命者。', '淵喉行者，有個緊急事件需要處理。\n\n我們的述命者不見了。他還沒來這裡，他之前應該是在追尋者議會…\n\n<路引師羅維斯停頓了一下。>\n\n你可以幫忙找到述命者嗎？很多侍從會利用廢墟附近的洞穴來躲避淵誓者。', '', '', '', '', '', '', 39653),
(63754, 'zhTW', '籠中鳥', '取得凱爾魯恩的獄鍛徽印，並解救被囚禁的丹妮卡。', '別出聲。不能引起騷動。\n\n我已經失去太多姊妹了。很快就要輪到我葬送在那個女巫的邪惡儀式下了。\n\n把我從這個牢籠裡放出去，我就能確保我們兩個都安全離開。我們必須警告守衛者歐丁，讓他知道我們遭到背叛！\n\n名叫凱爾魯恩的淵誓者持有能釋放我的徽印。她現在就在附近的建築中沾沾自喜。', '', '', '折磨專家凱爾魯恩', '', '', '', 39653),
(63740, 'zhTW', '請示專家', '與博文者的紀念碑交流感應。', '我們能修復尋引寶杖的功能，但是需要多位博文者的智慧才能完成。\n\n光靠我不夠，還要有先前的博文者才行。他們就在附近長眠。考慮到科西亞受到如此嚴重的破壞，而且很有可能會繼續受到摧殘，這或許是在他們的紀念碑被徹底毀壞之前，能拜訪他們的最後機會。\n\n拜訪博文者紀念碑，帶羅述爾一起去，讓他在紀念碑被摧毀前記下那些資訊。', '', '', '', '', '', '', 39653),
(63739, 'zhTW', '希望揚升', '在希望坡山頂附近與博文者羅瑟娜拉和學者羅述爾碰面。', '我們還有最後一件事情需要去做。\n\n到希望坡的山頂與我們碰面。', '', '', '', '', '', '', 39653),
(63738, 'zhTW', '建立博文庫', '到守衛者歇息地找學者羅述爾。', '我會前往守衛者歇息地，那邊還算安全。\n\n我們會在那裡建立新的博文庫。\n\n等你準備好之後，到那邊與我碰面。\n\n希望你接下來仍會繼續努力。我們日後還會需要你到那邊協助我們。', '', '', '', '', '', '', 39653),
(63737, 'zhTW', '尋找真正的使命', '參加儀式，啟動尋引寶杖。', '我們所做的一切努力，帶領我們走到了這一步。\n\n透過博文者的集思廣益，外加$r$c的幫忙，我們要啟用尋引寶杖，開始搜索我們尋找的文物。\n\n如果成功，我們就能掌握重建博文庫的關鍵。\n\n如此一來，我們的神聖使命就能延續下去。', '', '', '', '', '', '', 39653),
(63736, 'zhTW', '灌注靈魄', '將靈魄灌注到尋引寶杖裡面。', '一般來說，我們會使用另一個重要文物：虛空之星來將能量注入到尋引寶杖裡面。\n\n不幸的是，我們這次沒辦法這麼做。現在情況緊急，可以暫時用靈魄來代替。\n\n拿著尋引寶杖，到下方河口殺死吞噬者，然後在屍體旁邊揮動法杖。\n\n寶杖應該會吸收他們的靈魄。', '', '', '', '', '', '', 39653),
(63734, 'zhTW', '斷裂法杖', '找回尋引寶杖的三個組件。', '我別無選擇，只能相信你，把尋引寶杖的秘密告訴你。\n\n這個寶杖如果交給正確的人保管，比方說受過訓練的博文者，就能用來尋找暗影之境無數死後世界裡的強大古物。\n\n這個法杖被拆成三個部分，以免法杖落入惡人之手，雖然目前落入入侵者手中，但是他們還沒有意識到法杖的重要性。\n\n找回法杖的組件。各個組件皆由不同的淵誓者成員持有。', '', '', '', '', '', '', 39653),
(63733, 'zhTW', '殺出一條血路', '擊敗$1oa個入侵的淵誓者。', '我痛恨暴力，面對衝突的時候，我喜歡以理性的方式解決，但這次的情況讓我別無選擇。\n\n為了讓羅述爾和我自己能夠安全逃脫，你必須對入侵追尋者議會的淵誓者痛下殺手。\n\n殺出一條血路，讓我們能夠逃脫。', '', '', '', '', '', '', 39653),
(63732, 'zhTW', '中斷審問', '拯救博文者羅瑟娜拉。', '噓……小聲一點！\n\n要是入侵者發現我在這裡，他們一定會殺了我，就像他們殺了其他人那樣！\n\n<羅述爾不停地指向淵誓者的所在方向。>\n\n他們正在折磨博文者！\n\n你必須想辦法救她。不能讓淵誓知道她握有的情報！', '', '這個審問者冷酷無情且噁心至極。', '審問者贊屈', '', '', '', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63731, 'zhTW', '研究科西亞文物', '找到學者羅述爾，進一步了解有關上古文物的事情。', '<你找到一本破損的書，上面記載了科西亞藏有的文物。\n\n有個名字浮現在書中：羅述爾。\n\n書冊在你手中旋轉，指著某個方向，羅述爾這個名字不斷跳動。\n\n說不定羅述爾可以告訴你找出那些文物的資訊。>', '', '', '', '', '', '', 39653),
(63728, 'zhTW', '家族之中的戰士', '與伊瑟拉交談進一步了解詳情，然後前往知識墓穴尋找胡恩‧高嶺。', '我在夢境中看見，泰蘭妲‧語風對於亞登曠野的生存無比重要。\n\n暗夜妖精在尋找著像她這樣，曾經成為黑夜戰士的人。我們找了胡恩‧高嶺這位來自艾澤拉斯的老盟友，請他協助我們尋找。\n\n沒有任何凡人能獨自承受伊露恩的力量，泰蘭妲也一樣。我不曉得她還能撐多久。\n\n我來跟你說明一下這次的任務，然後你得迅速前往瑪卓薩斯找胡恩。', '', '', '', '', '', '', 39653),
(63727, 'zhTW', '統御者歸來', '到守衛者歇息地與統御者碰面，擬定新的作戰計畫。', '閻獄之主目前握有四個符印，只差最後一個就能實現他的陰謀。\n\n他不該讓我們活命。他妄想見到我們承認失敗、向他臣服，這會成為他最大的敗筆。\n\n只要你願意努力，我們就有希望。我們還有一個辦法。\n\n來吧。我想見見你剩下的部隊，規劃下一場攻擊。', '', '', '', '', '', '在科西亞與統御者交談。', 39653),
(63726, 'zhTW', '解開符印', '與伯瓦爾交談，討論該拿這個符印怎麼辦。', '統御者的符印與回憶魔法緊緊相連。這使我回想起你之前曾經遭遇過的某樣事物。\n\n你與符刻師結為盟友。那個被困在托迦司深處的可憐蟲。他拿走了你找到的那些回憶，並協助你打造出武器和護甲。\n\n或許他能夠從這雜亂無章的回憶當中把符印分離出來。\n\n這是我們能夠把符印拿到手的最好機會。但前方的道路危難重重。', '', '', '', '', '', '在托迦司與統御者交談。', 39653),
(63725, 'zhTW', '進入寶庫', '在科西亞的寶庫中找到統御者符印。', '這個地方遭到破壞的情況…很不樂觀。\n\n<塔迦蘭呢喃唸著禱詞。>\n\n靈魄不斷流入寶庫剩下的部分中。我們現在應該能夠進去了。\n\n進去之後，我會試著找到統御者的符印。\n\n在寶庫裡面的言行請務必端莊尊重。很少有人可以進入這個神聖的地方。\n\n就連預言的內容也沒有提到會有活著的凡人親眼見證寶庫裡的秘密。', '', '', '', '', '', '把統御者符印帶去科西亞交給伯瓦爾‧弗塔根。', 39653),
(63722, 'zhTW', '科西亞的守衛者', '在玄秘寶庫四周拯救3位紀錄守衛者。', '我們勉強才擋住閻獄之主的部隊。還好你來了，我們接下來應該能有所斬獲。\n\n我知道你的首要之務是進入寶庫，但是你也得救回我們的紀錄守衛者。\n\n他們對於寶庫裡的一切再熟悉不過，不能讓閻獄之主掌握他們知道的資訊。', '', '', '', '', '', '在玄秘寶庫內與武鬥士梅維斯會合。', 39653),
(63717, 'zhTW', '捍衛寶庫', '協助保衛者卡雷夫擊敗入侵的淵誓者部隊。', '我們必須在攻勢猛烈的淵誓者中殺出一條血路，才有辦法抵達寶庫。\n\n誓盟正竭盡全力抵禦敵軍的進攻，但盟友沒辦法像這樣一直撐下去。淵誓者打算搶先你一步把目標拿到手。\n\n淵喉行者，我們需要你協助對抗閻獄之主的部隊。\n\n願使命指引眾人。', '', '', '', '', '', '在玄秘寶庫內與武鬥士梅維斯會合。', 39653),
(63714, 'zhTW', '前往寶庫', '搭乘殘翼運輸獸前往玄秘寶庫', '多虧骸骨工匠把兩個導體都修復好了，靈魄現在應該能夠流入寶庫裡面。這樣一來，我們就有機會進入寶庫了，但前提是我們得先抵達寶庫的所在位置。\n\n瑪卓薩斯盟友替我們抓到了交通工具，能夠帶領我們往返寶庫。事不宜遲，我們最好快點。\n\n如果閻獄之主的爪牙先行一步拿到統御者符印，到時候遭殃的可就不只有科西亞了。整個暗影之境都會淪陷。\n\n淵喉行者，快走吧。我方部隊正在等我們呢。', '', '', '', '', '', '在玄秘寶庫與保衛者卡雷夫交談。', 39653),
(63713, 'zhTW', '鉤過去', '使用鉤射槍前往浮空島嶼並修復靈魄導體。', '我做了一些不錯的鉤槍和固定處。別擔心，如果連我的重量都承受得住，那麼你肯定不成問題！\n\n我們可以利用這些工具越過深溝，找到下一個靈魄導體。\n\n我先走一步，在另一頭等你。我們不曉得對面會有什麼樣的危險在等著我們。\n\n我們盡快修復好靈魄導體，然後趕快進入寶庫，並把統御者的符印拿到手吧。', '', '', '', '', '', '', 39653),
(63712, 'zhTW', '遺失的資料', '使用矩陣光標收復$2oa個遺失的紀錄。', '在科西亞被拉入淵喉的時候，一部分的紀錄守衛者逃到了這座山中。\n\n我沒看見對方的蹤影，但是他們說不定有留下紀錄。\n\n拿好這個信標。我利用你先前拯救的紀錄守衛者所提供的資訊改造過了。\n\n如果這座山脈上有完整的紀錄資料的話，這個信標就能夠引導你找到它。', '', '', '', '', '', '', 39653),
(63711, 'zhTW', '白骨工具', '從野生動物身上收集$1oa個充滿靈魄的白骨。', '看來我們必須抵達浮空的島嶼，才有辦法使用開啟寶庫的關鍵裝置呢。\n\n不成問題。\n\n我看這附近有許多身強體壯的生物。常言道，不要浪費骨頭！\n\n幫我帶一點那些生物的白骨過來。我會使用那些白骨打造出鉤槍固定器，帶領我們前往那座飄浮的島嶼。', '', '', '', '', '', '', 39653),
(63710, 'zhTW', '靈魄軌跡', '跟隨靈魄軌跡，找到下一個導體。', '原來，閻獄之主是在尋找統御者的符印。我們必須搶在淵誓者之前找到它才行。不過我們得把靈魄灌到寶庫裡，才有辦法開啟。\n\n當初第一個導體就是由你協助骸骨工匠修復的。我們前方的靈魄軌跡應該能夠引導我們找到下一個導體。\n\n如果可以啟動那個導體的話，應該就會有足夠的靈魄流動到科西亞，讓我們能夠進入寶庫。\n\n來吧，我們動作必須快點！', '', '', '', '', '', '在靈魄軌跡的盡頭與塔迦蘭和骸骨工匠黑彌爾碰面。', 39653),
(63709, 'zhTW', '寶庫的秘密', '與塔迦蘭一起檢視找到的紀錄資料。', '幸好你及時拯救了紀錄守衛者！淵誓者並沒有從他們那裡竊取有關寶庫中文物的情報。\n\n但是我們所掌握的紀錄很零散，並不完整。但願殘留下來的資訊夠我們習得真相。\n\n我會嘗試把僅存的知識重組成訊息。如果使命保佑的話，我們就可以釐清閻獄之主想要什麼，並找到東西的原主人。\n\n讓我稍微專注一會兒。準備好要開始的時候，就告訴我一聲。', '', '', '', '', '', '', 39653),
(63708, 'zhTW', '如夢似幻', '把扭曲幻魄帶去給維娜里避難所的維娜里。', '<這個散發出異世界能量的奇異塵埃不規律地閃爍著亮光。\n\n維娜里可能會對它感興趣。>', '', '', '', '', '', '', 39653),
(63706, 'zhTW', '讓靈魄流一會兒', '幫助骸骨工匠黑彌爾修復靈魄導體。', '塔迦蘭有跟我簡短說明了現在的狀況，也有解釋寶庫的運作機制。至少以學者的角度來看，他盡力說清楚了。\n\n首先，我們必須提供充足的能量給寶庫。這裡的人透過地底下的導體替寶庫注入靈魄。\n\n根據侍從指出，學者居所的洞窟裡面應該就藏有這麼樣的一個導體。\n\n只要帶我找到導體，我就有辦法加以修復。在我釐清這些科西亞裝置的運作方式時，我需要你保護我。', '', '', '', '', '', '', 39653),
(63705, 'zhTW', '知識守衛者', '從學者居所中救出$1oa個紀錄守衛者。', '這座寶庫的建立，是為了儲存無數的秘密與古文物。就算我們進得去，也沒辦法確定閻獄之主在尋找什麼東西。\n\n一部分的侍從被尊為紀錄守衛者，他們負責管理儲存在寶庫裡面的器物，而且是我們當中最嚴謹審慎的人。\n\n有好幾個守衛者被淵誓者俘虜，並且正遭受嚴刑逼問。\n\n$n，請務必要救出那些紀錄守衛者。他們可以幫助我們釐清監禁者在尋找的是什麼東西！', '', '', '', '', '', '', 39653),
(63704, 'zhTW', '為科西亞報仇', '在學者居所殺死$1oa個淵誓者。', '雖然說眼下的當務之急是進入寶庫，但我需要你幫我一個忙。\n\n科西亞被拉入淵喉的時候，我的同胞嚇壞了。我們逃到了你現在所看到的這個地方，也就是名為學者居所的寧靜之地。\n\n沒過多久，淵誓者就找上了我們。我們許多同胞都被殺死了。剩下的人則是慘遭俘虜。\n\n我好希望能夠親手幫他們報仇雪恨。但是我…我的能力在戰場上不管用。你跟我不一樣。\n\n拜託你了，我們必須讓這些禽獸知道，他們想玷汙科西亞必須付出代價。', '', '', '', '', '', '', 39653),
(63703, 'zhTW', '玄秘寶庫', '在學者居所外面與塔迦蘭碰面。', '淵喉行者，你協助我們稍微重振了秩序，但前方的道路依舊危機重重。\n\n閻獄之主的部隊發動了總攻擊，目標是位於科西亞邊陲地帶、已經化成廢墟的寶庫。監禁者顯然是在尋找寶庫裡面的某個寶物。\n\n當寶庫受到威脅時，建築物的防禦機制就會啟動，因此要進去可沒那麼簡單。即便如此，我們還是必須搶先淵誓者一步，取得閻獄之主正在尋找的東西。\n\n我找了一名死靈領主幫忙，可以幫助你開啟進入寶庫的通道。', '', '', '', '', '', '在學者居所外面與塔迦蘭交談。', 39653),
(63690, 'zhTW', '亞歷山卓斯‧莫格萊尼最好的朋友', '', '', '', '', '', '', '', '', 39653),
(63688, 'zhTW', '米卡尼寇斯最好的朋友', '', '', '', '', '', '', '', '', 39653),
(63683, 'zhTW', '凜冬符印', '把姊妹之淚帶給在森林之心的伊瑟拉。', '我的妹妹啊…原來這麼久了…她沒有放棄我…\n\n<凜冬女王的嘴角揚起一抹淡淡的笑容，但很快就消失無蹤。她把目光轉移到你身上，眼神乘載著萬古的重量。>\n\n$n，請聽我說。帶著我妹妹的眼淚，前往森林之心。', '', '', '', '', '', '', 39653),
(63682, 'zhTW', '伊露恩之力', '協助進行儀式。', '我們時間有限，已經盡力而為。\n\n現在，我們必須把力量借給塞爾納斯和其他人，然後祈禱泰蘭妲能夠活下來。', '', '', '', '', '', '', 39653),
(63681, 'zhTW', '回到森林之心', '回去亞登曠野的森林之心前找伊瑟拉。', '我們應該盡快趕回亞登曠野！\n\n你直接去找伊瑟拉。我會護送石鑄宗匠，並確保胡恩能夠平安回來。', '', '', '', '', '', '回去亞登曠野的森林之心前找伊瑟拉吧。', 39653),
(63680, 'zhTW', '瀕臨邊緣', '追查胡恩‧高嶺的下落。', '胡恩好像被石鑄宗匠本人抓去別的地方了！\n\n我們來找找看有沒有什麼線索能夠判斷她的去向。說不定這樣子就能找到胡恩！', '', '', '', '', '', '', 39653),
(63679, 'zhTW', '充滿魔法的神秘之旅！', '到瑞文崔斯找月莓女士。', '<月莓女士的聲音從卷軸裡面傳了出來。>\n\n$n！胡恩好像遇到麻煩了。情況…有點棘手。我們需要你到瑞文崔斯幫忙！請到威權要塞來找我。\n\n待會見！', '', '', '', '', '', '到瑞文崔斯找月莓女士。', 39653),
(63678, 'zhTW', '替阿卡雷克報仇', '在祭儀家族的埃索拉瑪斯與藩侯辛丹碰面。', '害死藩侯阿卡雷克的叛徒全都死光了。\n\n雖然這麼做救不回死去的藩侯，但至少我內心舒坦了一點。\n\n女爵大人希望我們在出發前往亞登曠野之前，能夠先去告訴藩侯辛丹，我們的任務已經完成。', '', '', '', '', '', '在祭儀家族的埃索拉瑪斯與藩侯辛丹碰面。', 39653),
(63677, 'zhTW', '你只有死路一條', '在埃索拉瑪斯殺死法辛吉。', '我名單上的最後一個目標，是名為法辛吉的巫妖。\n\n辛丹一直都在密切監視他，想要從中了解科爾蘇加德的下一步計畫是什麼。\n\n她想要用殘忍的方法處決法辛吉。\n\n他在祭儀家族的埃索拉瑪斯。', '', '殺死法辛吉。', '法辛吉', '', '', '', 39653),
(63676, 'zhTW', '無處可藏', '取回科爾蘇加德的信物，並殺掉卓瓦歐拉。', '有些科爾蘇加德的同夥，在他大肆展開行動後，仍然繼續隱藏其與科爾蘇加德之間的瓜葛。他們同樣必須為藩侯的死負責。他們同樣得死。\n\n我目前掌握了其中一個人的名字，叫作卓瓦歐拉，但除此之外還有很多其他人。辛丹向我透露，這些叛徒身上都帶有科爾蘇加德的信物。她不曉得叛徒的具體身分，所以我們會直接大開殺戒，直到找出真兇為止。\n\n這同時還能起到殺雞儆猴的效果。', '', '', '', '', '', '', 39653),
(63675, 'zhTW', '無處可逃', '蒐集線索並殺死澤瑪尼。', '澤瑪尼與藩侯的死脫不了關係。\n\n辛丹認為他正在替科爾蘇加德招募忠誠的爪牙，準備進行下一個陰謀詭計。\n\n我們要找出有關他下落的線索，然後宰了他。', '', '', '', '', '', '', 39653),
(63674, 'zhTW', '徵得同意', '在統御者之座與瓦許女士交談，並請求卡莉克的幫助。', '女爵瓦許女士派了一個任務給我。如果有人能夠幫我的話，我很快就能夠報仇雪恨。但我們必須先徵得她的同意，這樣我們才能夠互相幫助。\n\n去統御者之座那裡吧。我們會在那邊找她談談。', '', '', '', '', '', '', 39653),
(63673, 'zhTW', '家族之中的戰士', '到瑪卓薩斯找胡恩‧高嶺。', '$n，我有好消息要告訴你。在誓盟彼此之間的合作變得更加緊密之後，胡恩的搜尋任務進行得越來越順利了。他掌握了有關兩個黑夜戰士所在位置的可靠情報，對方就在暗影之境這裡。\n\n他請你去瑪卓薩斯找他，他會告訴你第一個黑夜戰士在哪裡。胡恩在知識墓穴等你去找他。\n\n$n，動作快。伊露恩的力量正在吸取泰蘭妲體內的精華。我不曉得她還能撐多久。', '', '', '', '', '', '', 39653),
(63672, 'zhTW', '來自森林之心的呼喊', '到森林之心與伊瑟拉碰面。', '<在你閱讀文字的同時，伊瑟拉的聲音從卷軸裡傳出。>\n\n$n，\n\n有一件很重要的事情需要你協助。請盡速前往森林之心與我碰面。', '', '', '', '', '', '', 39653),
(63669, 'zhTW', '來人啊，餵凱文吃餅', '吞噬$1oa個死去的敵人，讓凱文成長為完全體。', '我的軟泥怪家族無時無刻不需要更多靈魄，這個地方的屍體正好可以讓軟泥怪飽餐一頓。\n\n軟泥怪吞噬越多的靈魄，就可以成長得越巨大。亡者的殘餘將成為我們的一部分，造就我們這個美妙又快樂的家族！\n\n帶著凱文去吞噬死去的敵人，直到它吃飽為止。接著，等到它成長為完全體時，我們就可以派它去對付敵人！', '', '', '', '', '', '回去找德拉卡女爵。', 39653),
(63665, 'zhTW', '通往奧睿博司', '啟動甬道石，前往奧睿博司。', '預言曾紀載，有一天淵喉行者會需要用到這個休止的甬道石。說這會影響暗影之境的命運。\n\n看來那一天已然來到。\n\n喚醒你體內的靈魄，啟動這個甬道石。如此一來，任何與你同心一意的盟友都能使用。\n\n如果塔因納拉確實像你說的一樣，在奧睿博司建立了錨點，那就能引導你回來找我們。\n\n$n，去吧。告訴你的盟友：淵喉等著他們，而科西亞需要他們的協助。', '', '', '', '', '', '在樞運之環與伯瓦爾‧弗塔根交談。', 39653),
(63664, 'zhTW', '重點整理', '保護墮滅堡內部的前進據點。', '我們在通往統御祭壇的橋樑附近的據點遭受敵方猛烈攻擊！我們絕對不能失去搭建在那裡的弩砲。\n\n淵喉行者，我需要你去保護那個地方，直到我方部隊能夠推進為止！', '', '', '', '', '', '回去找德拉卡女爵。', 39653),
(63663, 'zhTW', '玄秘之城科西亞', '讓維娜里掃描這個區域，然後調查找到的東西。', '淵喉行者，我們都很接近各自的目標了。\n\n你志向遠大的甬道石應該不遠。當然，我的需求，則是相對樸實許多。東一點有用的情報，西一個無價的古文物…\n\n我們先調查這個區域，看看附近有沒有什麼實用或危險的東西。然後我們再繼續深入。', '', '', '', '', '', '在未啟動的甬道石附近與塔迦蘭交談。', 39653),
(63662, 'zhTW', '淵喉的秘密', '跟隨維娜里一起前往淵喉裡面的新陸塊。', '凡人啊，淵喉正在發生改變。轉機也伴隨而至。\n\n閻獄之主把一座藏在暗影之境深處的界域轉移到了淵喉。我對那個地方有相當程度的興趣，但我不想要隻身前往。\n\n是這樣的，那個地方到處都是淵誓者。他們肯定是在尋找某個很有價值的東西。\n\n我在那片土地附近建立了安全藏匿點。跟我一起前往，我說不定能夠幫你找到你所需要的甬道石。\n\n你說怎麼樣？', '', '', '', '', '', '在新區域外與維娜里交談。', 39653),
(63661, 'zhTW', '連結至淵喉', '詢問維娜里有關第二個甬道石下落的事情。', '述命者很確定有第二個甬道石出現在了淵喉。你必須找到它。\n\n我會在奧睿博司這邊製造出繫錨，並將其連結至你的靈魄。在你與新的甬道石同調後，這個繫錨就會跟甬道石連結起來。\n\n如果你成功的話，誓盟就能夠派遣軍隊安全地往返淵喉了。\n\n利用你在淵喉得到的資源找出這個甬道石吧。\n\n祝你好運，凡人。願使命指引我們大家。', '', '', '', '', '', '到維娜里避難所與維娜里交談。', 39653),
(63660, 'zhTW', '淵喉大開', '允許塔因納拉檢視你的靈魄。', '閻獄之主又拿到了另一個符印，而他的軍隊已然主動進攻奧睿博司。\n\n伯瓦爾‧弗塔根和瑪卓薩斯的德拉卡建議主動進攻閻獄之主的大本營。\n\n為此，我們必須找方法讓部隊能夠安全地進出淵喉。\n\n在你出現之前，我們以為這是不可能的，但現在我相信有這樣的可能性存在。\n\n我必須檢視你的靈魄，確認這真的是使命所冀盼的事。', '', '', '', '', '', '到樞運之環與塔因納拉交談。', 39653),
(63659, 'zhTW', '驚懼領主！', '到科西亞跟統御者交談。', '這是我本週發現的第五個滲透進我們部隊的驚懼領主。不多加提防的話，他們會對我們的據點造成極大的傷害。\n\n生前我曾跟一位惡魔獵人學習如何辨識驚懼領主。要找出他們對我來說輕而易舉，但我只有一個人，分身乏術。\n\n我們一定要向統御者回報這些發現。', '', '', '', '', '', '到科西亞跟統御者交談。', 39653),
(63656, 'zhTW', '憤怒的意義', '向統御者回報。', '我會召集麾下的部隊，並立刻派遣一部分的兵力前往科西亞。我也會將瓦許女爵和凱爾薩斯召喚的器具分發下去，讓部隊有辦法進一步阻止納斯雷茲姆的入侵。\n\n我必須先處理其他事務，才有辦法親自前去科西亞。我必須保護威權要塞不受到進一步的滲透。\n\n我想統御者應該會想要知道最新的情報。你可以去告訴他，說你成功了。', '', '', '', '', '', '向統御者回報。', 39653),
(63655, 'zhTW', '憤怒勳章', '將憤怒勳章帶到罪殞城的平臺。', '淵喉行者。我會率領石源魔前往淵喉的深處，摘下每一個納斯雷茲姆的頭。\n\n不過，瑞文崔斯仍然具有重要的戰略價值，不能夠因為一時的自負而掉以輕心。\n\n因此，身為第二任憤怒收割者的我，在此將勳章委託給你，在我指揮戰爭的時候，由你來保管並使用這個勳章。\n\n使用勳章來強化收割者，阻止戴納瑟斯捲土重來，否則他將輕易奪回權位。', '', '', '', '', '', '將憤怒勳章帶到罪殞城的平臺。', 39653),
(63654, 'zhTW', '納斯雷茲姆', '從納斯雷茲姆手中搶回憤怒勳章。', '憤怒勳章不只是強大的古文物。納斯雷茲姆可能會用來將這整個界域扭曲，以達到他們的邪惡目的。除此之外，只要他們還握有勳章，我們就無法重新打造新的符印。\n\n他們魯莽的詭計已經造成餘燼區幾乎完全毀滅。我不會讓他們濫用我的勳章。\n\n走吧，我們去搶回來。', '', '', '', '', '', '在曙光要塞與雷納瑟王子交談。', 39653),
(63653, 'zhTW', '王冠權能', '追蹤憤怒勳章。', '我們準備好了。\n\n收割者廷衛會使用我們目前手邊所握有的勳章來尋找憤怒勳章。只要對方還沒有把勳章移動到其他界域，我們應該就能夠追查出勳章的下落。\n\n這個儀式並不容易，而且納斯雷茲姆特別擅長避人耳目。當你看到道路出現的時候，千萬不能猶豫，要加快腳步展開行動。\n\n等你找到對方，先等我們抵達再開戰。', '', '', '', '', '', '到曙光要塞與石鑄宗匠交談。', 39653),
(63652, 'zhTW', '不速之客', '在罪殞城消滅$1oa個納斯雷茲姆。', '雪拉…我是說納拉加斯，她應該不是獨自一人在行動的。我們必須做最壞的打算，我們的朋友和盟友之中，可能混入了敵人。\n\n收割者廷衛需要一點時間，才有辦法進行偵測儀式。我們在進行儀式的時候，會處於毫無保護的狀態。我需要你使用你當時在罪殞城的威權之門所使用的招數，把潛藏在我們之中的納斯雷茲姆揪出來。\n\n祝你狩獵順利。', '', '', '', '', '', '', 39653),
(63651, 'zhTW', '密文', '抄錄$1oa個煉獄火密文。', '如果納斯雷茲姆真的已經滲透到罪殞城內部，那麼他們一定會彼此溝通聯繫，而且不可能只透過手勢或言語這麼簡單。他們喜歡使用魔法把訊息寫出來，並利用簡陋的法術加以隱藏，讓一般人無法看見。\n\n我研發出一種魔咒，能夠讓你看見這些訊息。\n\n把這些密文給找出來，並告訴我裡面寫了些什麼。如果內容太艱澀你看不懂的話，我可以幫你翻譯。', '', '', '', '', '', '', 39653),
(63650, 'zhTW', '反滲透', '到罪殞城與雷納瑟王子碰面。', '瑪爾加尼斯。\n\n我已經許久的時光沒有談論起他的名字了。現在，我們必須獵殺他。\n\n如果他握有憤怒勳章，那麼他將無所遁形。我們可以利用手邊的其他勳章來追查他的行蹤。\n\n到罪殞城來找我，同時帶上你的驚懼領主獵殺小組。我感覺我們會需要更多人手幫忙。', '', '', '', '', '', '', 39653),
(63649, 'zhTW', '諜對諜', '追蹤並擊敗$1oa個驚懼滲透者。', '納斯雷茲姆。驚懼領主。無形訪客。\n\n他們種族有很多名字。他們在很久很久以前被創造出來，為的是成為整個宇宙中最厲害的間諜與滲透者集團。\n\n他們這次的入侵行動低估了三個人。凱爾薩斯‧逐日者、瓦許女爵和$n！\n\n我帶了一個與凱爾薩斯一同效忠伊利丹時使用過的工具，可以偵測納斯雷茲姆。我才是統領間諜的總管！\n\n我們出發去獵殺間諜吧。', '', '', '', '', '', '', 39653),
(63648, 'zhTW', '納拉加斯', '追殺並擊敗納拉加斯。', '我們不能讓納斯雷茲姆繼續持有石鑄宗匠的勳章。\n\n根據控罪者對我們任務的說明，我們必須要取得那個勳章才有辦法打造新的汎希爾符印。我相信這就是納拉加斯和她的爪牙剛才發動伏擊的原因。\n\n勳章的魔法並不隱密。在這個界域中，其效果很容易追蹤。我建議立即展開追獵，在納拉加斯獲得增援前將她消滅。', '', '技巧精湛的納斯雷茲姆滲透者。', '納拉加斯', '', '', '與雷納瑟王子交談。', 39653),
(63647, 'zhTW', '無形訪客', '在石鑄宗匠調查使者的企圖期間，跟她一起行動。', '驚懼領主。\n\n是啊。我怎麼沒想到呢？他們此時不回來找我們麻煩更待何時？我懷疑他們早在乾旱期間就已經回來了。\n\n我第一次看到你的時候，還在想你會不會是他們其中一人。自從他們逃離瑞文崔斯，已經過了好久好久的時間，如今的他們更加狡詐。\n\n但他們還不夠聰明…應該吧。\n\n來吧，淵喉行者。跟我來，不要大驚小怪。隨時準備好開戰。你帶來的這位使者可能不像你所想的那樣心懷好意。', '', '', '', '', '', '', 39653),
(63646, 'zhTW', '誓盟車隊', '召集特使並前往威權之門。', '我們需要全部七個勳章才有辦法鑄造新的汎希爾符印。\n\n統御者是正確的。我們需要的人正是石鑄宗匠。她對無形者的憎惡無窮無盡，而且她手上握有我們需要的最後一個勳章。我認為我們早就該說服她加入我們的陣營了。\n\n我來負責安排相關事宜。這次要先準備好禮物和外交禮儀再前去拜訪。\n\n你最好先讓雪拉知道，讓她能夠安排護送事宜。', '', '', '', '', '', '把統御者的訊息轉達給石鑄宗匠。', 39653),
(63645, 'zhTW', '曙光要塞囚犯', '聽雷納瑟王子訴說戴納瑟斯王的遭遇。', '噢，你還沒聽說吧。\n\n我們逮到他了。瑞文崔斯的主宰戴納瑟斯王被囚禁在自己的刀刃裡面。\n\n我們在攻打納撒亞城的戰事中，擊敗了那個傢伙。\n\n我們派出了無比英勇的軍隊，使盡一切努力準備。我們用上了所有技術技巧和財富。即便如此，能夠成功還真是一場奇蹟。\n\n也就是這樣，救贖者迎來了救贖。你還想要繼續聽我說嗎？', '', '', '', '', '', '', 39653),
(63644, 'zhTW', '壞消息', '到瑞文崔斯的曙光要塞和雷納瑟王子交談。', '不能低估納斯雷茲姆對我們部隊造成的威脅。他們的狡猾跟蛛眼家族最老練的精兵有得比，而我們對他們的計畫卻一無所知。\n\n幾千年前，有個汎希爾人用怒火將納斯雷茲姆逐出暗影之境。\n\n前往罪殞城，找到雷納瑟王子並把這份文件交給他。我會派我的間諜瓦許女爵，到那邊跟你會合。你可以借助她在對抗納斯雷茲姆上的經驗。', '', '', '', '', '', '到曙光要塞和雷納瑟王子交談。', 39653),
(63639, 'zhTW', '前往奧睿博司回報', '回到奧睿博司去找塔因納拉。', '亞登曠野成功抵擋住了攻勢強勁的淵喉爪牙。\n\n但這麼做還是不夠。\n\n回到奧睿博司去找盟友。必須要有人為這次的損失付出代價，我們要採取制裁行動。', '', '', '', '', '', '回到奧睿博司去找塔因納拉。', 39653),
(63638, 'zhTW', '不能坐視不管', '確認凜冬女王的安危。', '總算是…暫時…處理了希瓦娜斯和淵誓者的威脅。\n\n但是我們得快點確保女王和她的符印的安全。\n\n凜冬女王在森林之心外面，保護野性種子不被淵喉奪走。', '', '', '', '', '', '', 39653),
(63625, 'zhTW', '拿起斧頭向前衝！', '消滅$1oa個淵誓部隊和指揮官馬拉默特。', '我方部隊遭遇到敵人的頑強抵抗！淵喉行者，拿起武器主動出擊、痛宰敵人吧！\n\n消滅防禦大門的淵誓者部隊及其指揮官。', '', '', '指揮官馬拉莫特', '', '', '告訴德拉卡女爵你成功了。', 39653),
(63624, 'zhTW', '所經之路', '見證德拉卡的晉升儀式。', '瑪卓薩斯的軍隊很強大。即便維拉斯做出大逆不道的事情，大家也依舊能夠振作起來。\n\n我們的當務之急，就是重建一切。淵喉行者，一起來見證瑪卓薩斯的嶄新紀元吧！', '', '', '', '', '', '', 39653),
(63623, 'zhTW', '王座空缺', '回到統御者之座。', '淵喉行者。\n\n我不在的這段時間，你盡心盡力重振這裡的秩序，並讓死靈領主誓盟得以恢復元氣。為了表示感謝，我想要邀請你見證一場典禮。\n\n跟我一起回去我在瑪卓薩斯的權力核心。你對我們如此忠心耿耿，我也是時候予以回報了。', '', '', '', '', '', '到統御者之座與統御者交談。', 39653),
(63622, 'zhTW', '光榮奪勝', '回去科西亞找統御者。', '解決了黑爾雅和維拉斯後，我們今天對抗淵誓者，算是拿下了一場大勝利。這也展示了暗影之境整體團結起來的力量。\n\n我們最好盡快回到科西亞，免得一波未平，一波又起。', '', '', '', '', '', '', 39653),
(63621, 'zhTW', '拉動鎖鏈', '消滅鎖鍊守衛者。', '據說這傢伙稱之為鎖鍊守衛者。千萬不可以小看他的力量。他束縛了附近的靈魂，準備要對我們的所在位置發動攻擊。\n\n淵喉行者，我需要你在他攻過來以前，消滅這個威脅。', '', '在他鎖鏈的束縛下，所有靈魂的意志都會崩潰。', '鎖鍊守衛者', '', '', '', 39653),
(63620, 'zhTW', '叛徒的死期', '殺死維拉斯。', '維拉斯自從叛變以來，一直都是瑪卓薩斯的眼中釘、肉中刺。身為天選者家族的女爵，我必須負責消滅這個威脅…並且為藩侯克利瑟斯復仇。\n\n誠如統御者所說，擒賊先擒王，我們必須殺掉對方的領袖。\n\n現在就是出手的時機！', '', '維拉斯男爵是瑪卓薩斯的叛徒，他的死期很快就要到了。', '維拉斯男爵', '', '', '', 39653),
(63619, 'zhTW', '被遺棄的棄誓者', '拯救$1oa個棄誓者囚犯。', '等等…我認得你！淵喉行者！\n\n我的兄弟姊妹們遭到扭曲…遭到腐化。有些人自甘墮落，接受黑爾雅的力量，也有人努力反抗到底。但最後，我們大家都被迫臣服於她的力量。\n\n我在戰鬥開始的時候順利逃脫，但大多數倖存的棄誓者現在正受到恐怖的儀式折磨。\n\n拜託了，請你一定要解救他們。我們會回去昇靈堡，自願接受御靈者的審判。', '', '', '', '', '', '', 39653),
(63618, 'zhTW', '瑪卓薩斯最擅長的事', '在德司莫泰隆上層殺死$1oa個淵誓者。', '每多殺死一個敵人，我們的盟友就少一個麻煩。我們要提醒敵人，瑪卓薩斯正是為了戰鬥而存在。讓他們見識一下，膽敢威脅到暗影之境安危的人會有什麼樣悲慘的下場。\n\n殺死你所看到的每一個淵誓者。', '', '', '', '', '', '', 39653),
(63617, 'zhTW', '強行突破', '殺死鐵衛薩力克斯。', '這個地方戰況混亂，上層的大門無人看守。如果我們悄悄溜進去，對方說不定根本就來不及察覺。\n\n只有一位黑爾雅的心腹擋住我們攻進黑爾嘉德要塞的去路。去消滅這個對手！', '', '這個淵誓征服者率領部隊在德司莫泰隆對抗死後世界的聯軍。', '鐵衛薩力克斯', '', '', '', 39653),
(63616, 'zhTW', '開張順利', '打信號給澤瑞奎斯，展開攻勢。', '接下來，我們應該能夠展開攻勢了。\n\n打信號給澤瑞奎斯。我們要讓對手見識一下瑪卓薩斯亡城的威力，讓他們知道暗影之境聯軍不是好惹的！', '', '', '', '', '', '', 39653),
(63615, 'zhTW', '奪其翅膀', '使用淵誓鎖鍊殺死$1oa個獄誓破魂者。', '整個天空都被黑爾雅的琪瑞安手下給遮蔽了。如果不削減對方的數量，澤瑞奎斯和我們的空中盟友就難以推進戰線。\n\n我發現淵誓者習慣使用魔法鎖鏈。我們可以利用對方的裝備來反制敵人，把他們從天空中抓下來。', '', '', '', '', '', '', 39653),
(63614, 'zhTW', '手中的武器', '找到索爾的斧頭德葛拉。', '請等一下，$n。\n\n我們第一次在淵喉遇到黑爾雅的時候，我朝對方丟出了我的斧頭「德葛拉」，自從那之後，我就再也沒有見到它了。如果這裡真的是她的地盤，說不定我的斧頭也在這裡。\n\n那是我在納葛蘭親手打造的斧頭，它有著許多我跟家人相處的美好回憶。我希望能夠再次把那個斧頭握在手裡。', '', '', '', '', '', '', 39653),
(63613, 'zhTW', '遭譴者之門', '召喚$1oa個死亡之門。', '在打信號給澤瑞奎斯之前，我們必須先準備好發動攻擊。在一切準備就緒之後，我們的盟友會開啟死亡之門攻擊目標地區。\n\n我們必須從這裡召喚死亡之門。找出合適的戰略位置吧。', '', '', '', '', '', '', 39653),
(63612, 'zhTW', '指揮鏈', '在德司莫泰隆附近與德拉卡碰面。', '如果我們要在這麼接近閻獄之主地盤的位置建立據點，那我們就必須做好萬全的打算。\n\n維拉斯和黑爾雅目前撤退到了德司莫泰隆的城牆內側。他們以為自己的處境很安全，因此鬆懈了下來，替我們製造出了大好機會。\n\n我們要趁人不備展開奇襲。以快狠準的攻勢，毫不留情地痛擊對手，這樣子我們說不定能夠直搗黃龍，讓敵人變得群龍無首。', '', '', '', '', '', '在德司莫泰隆與德拉卡交談。', 39653),
(63608, 'zhTW', '河馬靈魂', '將河馬靈魂帶給森林之心的莫恩女士。', '河馬靈魂相當兇猛。你將來能任意化身為河馬之形態。>', '', '', '', '', '', '將河馬靈魂帶給森林之心的莫恩女士。', 39653),
(63607, 'zhTW', '恐角龍靈魂', '將恐角龍靈魂帶給森林之心的莫恩女士。', '<恐角龍靈魂殘暴而頑強。你將來能任意化身為恐角龍之形態。>', '', '', '', '', '', '將恐角龍靈魂帶給森林之心的莫恩女士。', 39653),
(63606, 'zhTW', '蜘蛛靈魂', '將蜘蛛靈魂帶給森林之心的莫恩女士。', '<蜘蛛靈魂靈巧又狡猾。你將來能任意化身為蜘蛛之形態。>', '', '', '', '', '', '將蜘蛛靈魂帶給森林之心的莫恩女士。', 39653),
(63605, 'zhTW', '尖角蜥靈魂', '將尖角蜥靈魂帶給森林之心的莫恩女士。', '<尖角蜥靈魂靈敏又聰明。你將來能任意化身為尖角蜥之形態。>', '', '', '', '', '', '將尖角蜥靈魂帶給森林之心的莫恩女士。', 39653),
(63603, 'zhTW', '犛牛靈魂', '將氂牛靈魂帶給森林之心的莫恩女士。', '<氂牛靈魂真摯而堅韌。你將來能任意化身為蠍尾獅之形態。>', '', '', '', '', '', '將氂牛靈魂帶給森林之心的莫恩女士。', 39653),
(63593, 'zhTW', '琪瑞安的新符印', '回去科西亞找統御者。', '昇靈堡的未來將由羈絆與奉獻精神構築，新的符印應運而生，象徵著我族前方的道路。\n\n請去跟統御者回報你做的一切。一旦他準備就緒，我們就會把符印送去給他。\n\n希望他能夠使用這個符印來阻止閻獄之主的計畫並拯救暗影之境。', '', '', '', '', '', '回去科西亞找統御者。', 39653),
(63592, 'zhTW', '新的道路', '與卡莉賽恩交談，參加在御靈者之座舉辦的儀式。', '今天會有新的楷模誕生。自從我們的界域產生以來，首次有神殿被改建，從此將象徵我們對彼此的關懷與奉獻。\n\n新的楷模、新的符印，以及琪瑞安的嶄新道路。\n\n這場儀式意義著實非凡！', '', '', '', '', '', '與奉獻楷模阿德雷特斯交談。', 39653),
(63591, 'zhTW', '盛大的歡迎會', '與卡莉賽恩交談以參加聚會，然後和你的靈魂之絆還有其他琪瑞安互動。', '$n，你在琪瑞安最艱難的時刻向我們伸出援手。你的無私奉獻，幫助我的族人迎來了嶄新的開始。\n\n如果你願意來參加儀式開始前的聚會，我們會感到很榮幸的。我們誓盟的許多成員都對你滿懷感激，並且希望能夠對你有所表示。\n\n今天是個充滿喜悅的一天。真高興你能來現場親眼目睹這一切！', '', '', '', '', '', '到忠誠之泉與卡莉賽恩談話。', 39653),
(63590, 'zhTW', '禱鐘響起', '在軍政官阿德雷特斯重新調整忠誠神殿的用途時保護他。', '我們的正道從現在起不再要求追巡者盲目獻忠誠，而應該激發來自內心的美德。提供一個正確的選擇。\n\n我們必須對遭遇難關的人們展現赤誠的奉獻之心，不論對方是最近剛到來的靈魂，還是需要我們伸出援手的同伴。\n\n我會使用我手邊所有的靈魄來改變這座神殿的意義，替琪瑞安開創嶄新的紀元。\n\n淵誓者恐怕會試著阻擾我們的計畫。$n，請在儀式進行時保護我。我必須親自完成這件事情。', '', '', '', '', '', '', 39653),
(63589, 'zhTW', '導向正軌', '將靈魄從忠誠要塞引導至神殿。', '昇靈堡的五大神殿自古以來就屹立不倒。從來沒有人思考過可以調整其中一座神殿的用途，這麼做肯定需要消耗大量的靈魄。\n\n這座神殿的地底下方貯藏著許多靈魄，是我們在乾旱期間限制使用的重要補給。如今，靈魄再次流淌在我們的界域之中，我們可以改利用這些靈魄貯藏完成現在的目標。\n\n你必須使用地表上的引導器和收集器，引導靈魄流到頂端。如此一來，我應該就能獲得我所需要的能量。', '', '', '', '', '', '', 39653),
(63588, 'zhTW', '重建信念', '說服$1oa個棄誓者重返道途。', '$n啊，棄誓者迷失了自我。\n\n他們就像是鬼魂一樣，遊蕩在忠誠神殿。哪裡也去不了。群龍無首、漫無目的、失去歸宿。\n\n我們必須讓他們看見向前的道路。\n\n我會陪你一起進去神殿。由我來與他們談話，我會喚醒他們的理智。說不定我們還能說服他們，讓他們願意試試看阿德雷特斯的新道路。', '', '', '', '', '', '', 39653),
(63587, 'zhTW', '可以回收的靈魄', '從棄誓者百衛體內收集$1oa個污化的百衛機兵核心。', '$n，米卡尼寇斯跟我解釋了很多有關棄誓者百衛的事情。\n\n我不敢說我全部都能理解，但看樣子他還沒找到穩定可靠的方法讓那些百衛恢復到正常的運作狀態。\n\n不過，他們體內的靈魄應該還能派上用場！\n\n阿德雷特斯一直專心在思考如何調整神殿的用途，卻忽視了自身的安全。我擔心他的靈魄在過程中會被吸乾。\n\n如果你能夠取出棄誓者百衛體內的核心，阿德雷特斯就會有靈魄貯存可以使用。', '', '', '', '', '', '', 39653),
(63586, 'zhTW', '奉獻的憐憫之情', '到侍者休憩處與阿德雷特斯碰面。', '我們第一件要做的事情，就是重新調整忠誠神殿的用途。\n\n佩拉苟斯自願留在這裡協助準備進行儀式。我希望尼可隆能夠帶領他的夥伴到侍者休憩處找我們，協助我們說服一部分的棄誓者跟隨我們踏上新的道路。\n\n如果你方便的話，就到那邊與我們碰面吧。', '', '', '', '', '', '到侍者休憩處與阿德雷特斯碰面。', 39653),
(63585, 'zhTW', '盲目的忠誠', '到樂土堡與軍政官阿德雷特斯碰面，然後陪伴他晉見御靈者。', '現在，我知道琪瑞安未來該何去何從了。\n\n首先，我們要去跟尼可隆談談。我希望你能夠留下來聽聽。\n\n之後我們會回去樂土堡。\n\n我要請求晉見御靈者，而且屆時我需要你們陪伴在我身旁。', '', '', '', '', '', '', 39653),
(63584, 'zhTW', '凱旋而歸', '到樂土堡與卡莉賽恩碰面。\n\n琪瑞安信差可以帶你飛過去。', '$n，這座神殿象徵著昇靈堡嶄新的曙光。\n\n奉獻神殿將成為我們共同努力的基石。我們會跟棄誓者合作，也會不分身分來歷接納所有的志士與琪瑞安，攜手打造出大家都能引以為榮的未來。\n\n我們回去樂土堡吧。我希望你能夠出席這個重要的場合，見證新楷模的晉升、見證新符印的誕生。', '', '', '', '', '', '到樂土堡與卡莉賽恩碰面。', 39653),
(63583, 'zhTW', '我打算永生不死', '協助烏瑟探索他的最後一段記憶。', '拜託了，$n。這件事情還沒有結束。\n\n我還必須探索最後一段回憶。必須面對的回憶。\n\n這段回憶…不堪回首。我需要你們大家的幫忙。\n\n我們必須這麼做。', '', '', '', '', '', '', 39653),
(63582, 'zhTW', '他是我的學生', '協助烏瑟探索他的第二段記憶。', '有關那個阿薩斯王子的回憶對烏瑟造成了很大的創傷。正是因為阿薩斯的關係，烏瑟的靈魂才會支離破碎，德沃絲也才會墮落。\n\n這些記憶所涉及的痛苦劇烈到難以想像。\n\n我們必須繼續深掘。烏瑟必須面對這個黑暗的源頭。\n\n你需要再次進入他的過往，如此才能捍衛他的未來。', '', '', '', '', '', '', 39653),
(63581, 'zhTW', '步入光明', '使用靈魂之鏡幫助烏瑟探索自己的過去。', '這是我最擔心的情況。\n\n烏瑟靈魂的這一部分遭到殺害他的哀傷之刃腐化。他的記憶破碎而扭曲。\n\n要讓烏瑟放下這段過去的痛苦、讓他的悲慟平息，他必須先重新經歷一遍。\n\n但他不必獨自承受。\n\n使用我的靈魂之鏡，我們就能幫助烏瑟重新面對這些回憶，讓他接受其中蘊含的情感。我們必須幫助他看透其中的扭曲，了解事情的真相。', '', '', '', '', '', '', 39653),
(63580, 'zhTW', '受傷的記憶', '幫助烏瑟建立與正義殘餘物之間的連結。', '烏瑟受傷的靈魂到來時，確實促成了許多我們目前陷入的困境。\n\n德沃絲的信念碎裂、她跟黑爾雅之間建立的關係。棄誓者的崛起。\n\n昇靈堡需要改變，但我們卻遲遲找不到方法。\n\n說不定這個靈魂碎片…能夠給我們一些啟發。', '', '', '', '', '', '', 39653),
(63579, 'zhTW', '聖騎士的靈魂', '從托迦司的放逐者骨窖取回正義殘餘物。', '在伯瓦爾‧弗塔根所預見的景象中，托迦司的深處藏有一個房間，閻獄之主會把對他有利用價值的靈魂關在裡面。\n\n烏瑟曾被一把哀傷之刃擊倒。當滿懷憤怒之人揮舞這種武器時，就連靈魂也會四分五裂。\n\n如果閻獄之主手上握有烏瑟的一部份靈魂，那麼除非我們能將失去的部分奪回，否則烏瑟的靈魂永遠也無法癒合。\n\n$p，帶著這個同調裂片前往托迦司。這個裂片應該能夠指引你找到靈魂的所在位置。\n\n找到烏瑟靈魂的失落碎片，他才有可能重歸完整。', '', '', '', '', '', '前往昇靈堡的智慧神殿與薩尼歐斯碰面。', 39653),
(63578, 'zhTW', '亞登曠野之戰', '在亞登曠野之戰中保護凜冬女王的符印。', '戴納瑟斯王背叛了我們，瑪卓薩斯的統御者也消失無蹤，想必閻獄之主的下一個目標就是凜冬女王。\n\n我們絕不會讓任何人奪走她的符印！\n\n亞登曠野經歷了許多苦難，但那個界域依舊充滿著強大的神祕能量。凡事並非總是如表象那樣簡單。\n\n不論女王面臨到什麼樣的危險，我們都會利用這點來應變。', '', '', '', '', '', '', 39653),
(63576, 'zhTW', '第一步棋', '到奧睿博司與軍政官阿德雷特斯交談。', '在誓盟團結起來捍衛暗影之境的同時，閻獄之主在托迦司裡頭也沒有閒著。他似乎正在盤算推動下一階段的計畫。\n\n軍政官阿德雷特斯從樂土堡帶來了令人不安的消息。等你抵達後，他就會告訴你發生了什麼事情。\n\n請不要耽擱，我們可用的時間正在急遽消逝。', '', '', '', '', '', '', 39653),
(63545, 'zhTW', '擬訂計畫', '將$2oa個百衛零件和$1oa個靈動機螺栓帶去給米卡尼寇斯。', '趁著瑪卓薩斯在攻打大門的時候，我們可以利用百衛進攻側門。\n\n許多受到閻獄之主腐化的百衛殘骸四散在這個區域。我們可以利用這些零件打造出新的百衛，協助我們攻打敵人。\n\n請你幫忙收集零件，讓我們能夠打造出新的百衛。', '', '', '', '', '', '', 39653),
(63543, 'zhTW', '死靈領主進攻戰', '在墮滅堡和寂滅之面完成$1oa個任務。', '我們的攻擊行動把閻獄之主的爪牙打了個措手不及。我們要攻破墮滅堡，然後在統御祭壇擊敗他的勇士！\n\n淵喉行者，我們需要你的幫忙。去戰場上支援我們的部隊吧！', '', '', '', '', '', '', 39653),
(63435, 'zhTW', '神殿大對決', '在寵物對戰中擊敗安西亞。', '我的父母忙著保護神殿…好像是什麼八…椰…神殿？反正我沒在聽。大概是這樣，他們才留我一個人在這裡吧。\n\n他們說我可以跟大白貓一起訓練。我要變成忍者！\n\n<安西亞朝你的方向踢了好幾腳。>\n\n呀！嘿呀！你給我小心一點！\n\n…\n\n我好無聊，你想要來一場寵物對戰嗎？我把我最喜歡的寵物都帶來了。', '', '', '', '', '', '', 39653),
(63100, 'zhTW', '悲慘的一群', '在『靈魂之河』果戈亞擊殺$1oa名無助軀殼。', '<這個可憐靈魂的軀殼被剝奪殆盡，幾乎什麼也不剩。\n\n不能讓這種悲慘的情況繼續下去，救救剩下可憐的靈魂吧。>', '', '', '', '', '', '', 39653),
(63043, 'zhTW', '被撕裂的靈魂', '在鍊魂塔破壞$1oa個撕魂者陷阱。', '我們之前…不受陷阱影響，有很多很多靈魂…逃跑。\n\n於是他們…做出新陷阱…把逃跑的靈魂…撕成碎片…\n\n…我已經沒救了，破壞陷阱…這樣別人才有機會逃出去！', '', '', '', '', '', '', 39653),
(62917, 'zhTW', '共享靈魂', '到魂絆熔爐找控罪者。', '收割者的力量流經你的凡軀。不過，只要與其他人建立靈魂之絆，你就能獲得更強大的力量。\n\n已知這麼做不會有任何壞處，而且雙方都能從中獲益良多。\n\n控罪者負責監督整個過程。等你準備好了，就去魂絆熔爐找她。', '', '', '', '', '', '', 39653),
(62852, 'zhTW', '曠野獵者的楷模', '到森林之心與艾瑟琳交談。', '幸會，$n！\n\n你向亞登曠野的所有人證明了你的能耐。我們會給你更多獎勵，表揚你的英勇和機智。\n\n到森林之心找我。', '', '', '', '', '', '', 39653),
(62851, 'zhTW', '不死軍團的楷模', '在苦痛劇場和納爾空‧塔爾森交談。', '你持續協助不死軍團達成目標，使你在軍中的人氣居高不下。\n\n我已經得到授權，可以撥出最近得到的一部分戰利品，作為你的謝禮。方便的話，請盡快到統御者之座找我，領取這些戰利品。', '', '', '', '', '', '', 39653),
(62850, 'zhTW', '晉升者的楷模', '在昇靈堡和位於英雄之陵的妮可絲副官交談。', '淵喉行者。\n\n透過你的努力，晉升者才能取得決定性的優勢，順利達成目標。\n\n我們要為此感謝並獎勵你。', '', '', '', '', '', '', 39653),
(62849, 'zhTW', '收割者廷衛的楷模', '到暗隱村與彌海菈女士交談。', '淵喉行者。\n\n透過你的努力，收割者廷衛才能取得決定性的優勢，有效對抗助紂為虐的狂熱者和奉承者，削弱戴納瑟斯王的力量。\n\n如果你能來暗隱村找我，我們就能用更加…實際…的方式，聊表謝意。\n\n當然，寶藏是少不了的。', '', '', '', '', '', '', 39653),
(62611, 'zhTW', '菌絲巡邏：心木林地', '透過妖精之環移動，並且在心木林地殺死$2oa個被附身的褻瀆者。', '那些戴面具的壞蛋占據了心木林地，我一定要阻止他們的計劃。$b$B心木林地以前真的很美麗。而現在，它卻變得…算了。我們要修正這個狀況，就你和我。現在馬上。$b$B來吧，和我一起戰鬥。我們會給那些怪物迎頭痛擊，讓他們的主子決定要再次褻瀆這片聖地時會三思而後行！', '', '', '', '', '', '', 39653),
(62563, 'zhTW', '又回來了！', '擊敗『破肚者』果岡圖斯', '果岡圖斯就是不肯放棄！\n\n我們已經打敗她好幾次了，但拾荒者總是會回收她的身體，修好她然後再把她派回來這裡！\n\n她以為這次能打敗我們…去證明她錯了。', '', '這具長命的傀儡歷經數次失敗，也重建了好幾次。', '『破肚者』果岡圖斯', '', '', '', 39653),
(62435, 'zhTW', '雄鹿靈魂', '將雄鹿靈魂帶給森林之心的莫恩女士。', '雄鹿靈魂高貴而強大。你將來能任意化身為雄鹿之形態。>', '', '', '', '', '', '將雄鹿靈魂帶給森林之心的莫恩女士。', 39653),
(62432, 'zhTW', '梟羽獸靈魂', '將梟羽獸靈魂帶給森林之心的莫恩女士。', '<梟羽獸靈魂好奇心旺盛又愛惡作劇。這種野獸結合了不同的部位卻又維持完美的平衡。牠們永遠都在尋求下一項挑戰。你將來能任意化身為梟羽獸之形態。>', '', '', '', '', '', '將梟羽獸靈魂帶給森林之心的莫恩女士。', 39653),
(62427, 'zhTW', '角鷹獸靈魂', '將角鷹獸靈魂帶給森林之心的莫恩女士。', '<角鷹獸靈魂聰明且勇敢。你將來能任意化身為角鷹獸之形態。>', '', '', '', '', '', '將角鷹獸靈魂帶給森林之心的莫恩女士。', 39653),
(62294, 'zhTW', '一個巫妖的垃圾…', '在祭儀家族裡面的雜物堆尋找和過去有關的線索，然後找出古怪的遠古聖物。', '有人說「一個人的垃圾是另一個人的珍寶」。這對聖物來說更是如此。\n\n祭儀家族出了名的喜歡保守秘密。這會讓任何我們能探知的知識都變得額外有價值。\n\n如果我們去搜一搜他們的廢棄物，我想一定能在裡面發現各式各樣的寶物。', '', '', '', '', '', '', 39653),
(62258, 'zhTW', '翱翔於昇靈堡', '', '', '', '', '', '', '', '', 39653),
(62239, 'zhTW', '清除鼠害', '在獸穴對$1oa隻巨型淵喉污鼠測試折磨者的節杖。', '<武器散發出黑暗、靜止的能量。這個淵誓者在測試的事情，似乎在附近的鼠類身上順利發生作用了。\n\n進一步調查可能可以獲得更多資訊。>', '', '', '', '', '', '把你發現的消息告知維娜里避難的維娜里。', 39653),
