(61737, 'zhTW', '劫持失蹤', '向納茲格寧姆打聽有關劫持事件的詳情。', '$n，有很多事情要向你說明。\n\n天譴軍團回來了。統御之盔被打碎後，藏在裡頭的邪惡力量已經不受任何拘束。無法控管。\n\n更糟的是，希瓦娜斯‧風行者派出了她的手下到我們每個王國的核心，並把每個在戰爭中阻撓她的對手都抓走了。\n\n和納茲格寧姆交談。他會和你說明接下來的事。', '', '', '', '', '', '向納茲格寧姆詢問有關劫持事件的詳情。', 39653),
(61736, 'zhTW', '劫持失蹤', '向莎莉‧懷特邁恩打聽劫持事件的詳情。', '$n，有很多事情要向你說明。\n\n天譴軍團回來了。統御之盔被打碎後，藏在裡頭的邪惡力量已經不受任何拘束。無法控管。\n\n更糟的是，希瓦娜斯‧風行者派出了她的手下到我們每個王國的核心，並把每個在戰爭中阻撓她的對手都抓走了。\n\n和懷特邁恩交談。她會和你說明接下來的事。', '', '', '', '', '', '向莎莉‧懷特邁恩詢問劫持事件的詳情。', 39653),
