(60869, 'zhTW', '把握希望', '在銀白聯賽場地建立一個奧格瑪傳送門。到奧格瑪的葛羅瑪許堡上方向洛索瑪‧塞隆回報。', '你必須將我們發現的事情回報給奧格瑪。我們的法師可以在聯賽場地幫你開啟一道傳送門。\n\n至於銀白十字軍，我們必須在這裡擔當抵抗天譴軍團的壁壘。如果你之後還想要幫助我們，我會確保你的技能可以發揮最大效用。\n\n願聖光保佑你，$n。', '', '', '', '', '', '', 39653),
(60861, 'zhTW', '見不得光的祕密', '在默德雷薩使用密謀者長袍，發掘埋藏的祕密。', '雖然我們一直在監控出現在默德雷薩的教徒，但我們還不知道那裡藏了什麼秘密。\n\n把這些長袍拿去。一路潛入最深處，看能不能有所發現。\n\n$n，這或許是找出他們秘密計畫的唯一機會。', '', '', '', '', '', '', 39653),
(60837, 'zhTW', '艾利歐德之怒', '', '', '', '', '', '', '', '', 39653),
(60767, 'zhTW', '天譴軍團回歸', '到暴風城的貿易區將沃農中尉的報告交給格里高指揮官。', '把我的報告送到格里高指揮官手中。一定要告訴他我們在面對的是什麼。\n\n天譴軍團的數量不斷攀升，如果他們沒有減少的傾向…願聖光保佑我們所有人。', '', '', '', '', '', '', 39653),
