(60132, 'zhTW', '星宿令狀和冥魄', '', '淵喉裡有太多東西有待發掘，而且很多東西可以化為未來的利潤。\n\n情報是種投資。\n\n這個地方有意思的東西還真不少，如果你有任何發現，我很樂意和你談個好價錢。\n\n找到東西拿過來，我們就可以開始議價。', '', '', '', '', '', '', 39653),
(60117, 'zhTW', '十字軍的回歸', '到暴風城的貿易區與格里高指揮官交談。', '天譴軍團已經失控，只知道到處殺戮。那些怪物遲早會擠滿我們的大街小巷。\n\n我們需要擅長處理這種威脅的專業人士。黯刃騎士團的死亡騎士願意助我們一臂之力，不過即便是他們也無法獨力應付。\n\n銀白十字軍已經響應號召。$n，我需要你與他們合作，保護人民的安危。\n\n我已經向他們的指揮官傳達你到來的消息。他正在城門內側的營地等你過去。', '', '', '', '', '', '', 39653),
