(57537, 'zhTW', '掩蓋我們的行蹤', '與德拉卡騎乘坐騎前往天選者家族領地。', '我隸屬於天選者家族。我們在南方有座要塞，那裡應該很安全。\n\n我們騎乘飛行坐騎走完剩下的路程，等你準備好了，就走到我的殘翼獸身邊。', '', '', '', '', '', '', 39653),
(57513, 'zhTW', '敵人的敵人', '逃離苦痛劇場。', '我很清楚你一定有很多問題想問，目前只要知道我們在這片土地上有共同的敵人就好。\n\n現在，我們該動身了。我會帶你去更安全的地方，到時候再詳談。', '', '', '', '', '', '', 39653),
(56470, 'zhTW', '給狗狗骨頭', '從巨大嗜髓蟲身上收集$1oa個嗜髓蟲肉。', '路易森把狗骨頭借給我要幫我找出一些嗜髓蟲，但是我忙著盯著這些爐子。你可以當個好人幫我獵一些回來嗎？\n\n狗骨頭最愛撲向小型的啃咬者，但他會發出吵雜的聲音。而大型的嗜髓蟲會被這些聲音嚇跑，這就是你該出手的時候了。\n\n用這個骨頭把狗骨頭引誘到啃咬者附近就對了。噢對了，別忘了從嗜髓蟲身上收集一些血肉，那才是你真正的目標。', '', '', '', '', '', '', 39653),
