(56072, 'zhTW', '未同步的電流刀刃', '把未同步的電流刀刃帶去鏽栓鎮交給莎菲蘿妮塔‧廢車。', '瘋狂顫動的刀刃，讓你想到這是鏽栓衛兵使用的武器。肯定有人能修好它。', '', '', '', '', '', '', 39653),
