(55036, 'zhTW', '可怕的地方', '完成一場恩若司的幻象。', '你可能已經注意到，艾澤拉斯各地出現了種種紛擾。上古之神正在崛起，對我們所有人而言，這都是壞消息。\n\n這種無盡真理之柱會在偶然的情況下出現。這名字真神奇，你不覺得嗎？我很擅長幫事物命名。\n\n我剛剛講到哪邊了？噢，對沒錯，這些柱子可以讓我們進入古神的意識。它們會讓你看到一段暗示，瞭解接下來會有什麼東西迎面而來，以及我們沒擊敗他的話世界會變成什麼樣子。\n\n你願意親自看看嗎？', '', '', '', '', '', '', 39653),
