(32847, 'zhTW', '機械布魯斯', '購買機械布魯斯的挑戰卡然後在鬥陣俱樂部向他挑戰並且擊敗他。', '大家都認識布魯斯，大家也愛布魯斯!而且到頭來，大家都會殺掉布魯斯。$b$b有個熟悉工程學的獸人獵人覺得這很可惜，所以他就把自己的鱷魚加裝了些武器。$b$b你贏得的挑戰卡讓你有資格和機械布魯斯一搏。這一定是場血戰。問題是...究竟是你咬牠，還是牠咬你?', '', '', '', '', '', '', 39653),
(32105, 'zhTW', '完好如初的紀念碑記錄簿', '展示考古文物。', '這件古物已經被回復到十分良好的狀態。也許你可以將它展示在知識之座，讓博學行者和考古學家們可以研究。', '', '', '', '', '', '', 39653),
(28005, 'zhTW', '徵集冒險者:死亡礦坑', '和何瑞修‧萊恩中尉談話。', '安杜因‧烏瑞恩國王有令，所有身強體壯的冒險者都必須前往西部荒野南部的死亡礦坑，不得拖延！$B$B阻止迪菲亞兄弟會重建毀滅巨艦來威脅這整個地區的行動，需要有人協助！如果你願意執行這項任務，前往死亡礦坑和這起事件的首席調查員何瑞修‧萊恩中尉交談，協助徹底阻止迪菲亞的陰謀。', '', '', '', '', '', '', 39653),
(26379, 'zhTW', '幫助難民', '洛丹諾的哨兵蘭卓拉希望你去難民營和女牧師艾爾琳雅談話。', '希望你是過來幫忙的。你不知道我在講什麼，對嗎...$B$B我沒有時間為你說明所有的細節，總之我們在黑海岸有座名叫奧伯丁的城鎮，在災難中受到了最嚴重的打擊。我們正在搜救一些生還者，但我需要像你這樣更有經驗的人。我們聽說南邊有個難民營地，去探望一下。$B$B將北邊的事務交給我們，直接南下，盡全力幫助那些難民。', '', '', '', '', '', '', 39653),
(14089, 'zhTW', '在提里斯法林地學習騎術', '到提里斯法林地的布瑞爾，把這本小手冊繳回給維爾瑪‧瓦納姆。', '這本介紹著騎術訓練與購買坐騎的小手冊是維爾瑪‧瓦納姆送來的。$B$B維爾瑪就在提里斯法林地的布瑞爾。', '', '', '', '', '', '', 39653),
(14083, 'zhTW', '在丹莫洛學習騎術', '到丹莫洛的凍石農場，把這本小手冊繳回給奧薩姆‧鐵角。', '這本介紹著騎術訓練與購買坐騎的小手冊是奧薩姆‧鐵角送來的。$B$B奧薩姆就在丹莫洛的凍石農場，沿著鐵爐堡外的路向東走即可抵達。', '', '', '', '', '', '', 39653),
(13253, 'zhTW', '死亡證明:洛肯', '達拉然的大法師朗達拉克要求你，帶回天界紅寶石戒指。$B$B這個任務只能在英雄難度中完成。', '洛肯屹立於雷光大廳之中，策劃著終結我們世界的計畫。需要我複述一次嗎，$n?$B$B他安坐在那裡，聆聽著禁錮於北裂境之底古神的瘋狂囈語。你和你的朋友必須立刻前往風暴群山!$B$B在地疆瞭望塔中挺身面對洛肯，在事情還來得及挽回之前!把他的紅寶石戒指帶回來，好讓我知道我們再次安全了。', '', '', '', '', '', '', 39653),
(13203, 'zhTW', '冬幕節禮物', '', '', '', '', '', '', '', '', 39653),
(10459, 'zhTW', '得到塞納里奧遠征隊的尊敬', '塞納里奧避難所的伊斯歐‧風詠要你贏得塞納里奧遠征隊的尊敬。', '我們注意到你的成就，$n。你對我們所做的事遠超過我們對盟友的期望。$B$B我對你有個特別的要求，但我首先得考驗你的奉獻。', '', '', '', '', '', '', 39653),
(8740, 'zhTW', '暮光掠奪者', '殺死暮光掠奪者莫娜和2個暮光掠奪者。任務完成之後就回去向喚風者傲角報告。你還必須隨身帶著戰術任務簡報 IX才能完成這個任務。', '許多暮光之錘的騎兵經常在我們塞納里奧城堡守衛範圍之外的區域遊蕩，並伺機襲擊我們巡邏兵和商旅小隊。$B$B找到並擊敗暮光掠奪者和他們的領袖，一個名叫莫娜的可怕戰士。當任務完成之後，去向喚風者傲角報告。', '', '', '', '', '', '', 39653),
(8737, 'zhTW', '蒼藍聖殿騎士', '召喚並殺死一名蒼藍聖殿騎士，然後向塞納里奧城堡的鮑爾·蠻鬃覆命。你還必須將戰術任務簡報 I帶去才能完成這個任務。', '暮光之錘和他們所膜拜的元素生物對我們在希利蘇斯地區的行動是個不小的威脅。安其拉高牆內的敵人還在虎視眈眈，所以我們絕對不能對暮光之錘的勢力掉以輕心。$B$B想辦法召喚並摧毀一名蒼藍聖殿騎士，然後向鮑爾·蠻鬃回報。', '', '', '', '', '', '', 39653),
(8538, 'zhTW', '四個公爵', '設法召喚並擊殺辛德爾公爵、深淵公爵、微風公爵和裂石公爵，然後向塞納里奧城堡的指揮官瑪爾利斯覆命。你還必須隨身帶著戰術任務簡報 V才能完成這個任務。', '暮光之錘和深淵議會的連結證實比我們預期的還重要。$B$B人們相信被稱為深淵聖殿騎士的元素貴族，是支配塞納里奧城堡暮光之錘祭司大規模攻擊的主導力量之一。想辦法將他們引誘到我們的世界來並摧毀他們!$B$B你往日的貢獻和成功使我們決定派你來執行這項任務。相信你可以輕鬆完成。', '', '', '', '', '', '', 39653),
(8348, 'zhTW', '公爵的徽記', '把深淵徽記帶給塞納里奧城堡的鮑爾·蠻鬃。', '胡姆告訴我說你知道召喚深淵公爵的方法了!真是件了不起的事兒。$B$B還有什麼能稱得上是了不起的成就呢?打扁這些傢伙。如果你明白我在說什麼，你就該知道這會對他們的屬下帶來多大的衝擊。把他們的徽記帶回來作為證據。', '', '', '', '', '', '', 39653),
(8264, 'zhTW', '污染者的標準醫療包', '', '', '', '', '', '', '', '', 39653),
(8261, 'zhTW', '阿拉索標準醫療包', '', '', '', '', '', '', '', '', 39653),
(8260, 'zhTW', '阿拉索基本醫療包', '', '', '', '', '', '', '', '', 39653),
(8258, 'zhTW', '達克雷爾的威脅', '在斯坦索姆地下室的屍骨儲藏所的中心使用預言水晶球。然後你必須與被召喚出來的幽靈作戰。擊敗這些幽靈之後，死亡騎士達克雷爾才會出現，你的任務就是擊敗他。$B$B把死亡騎士達克雷爾的頭顱交給奧格瑪智慧穀的薩格尼。', '死亡騎士達克雷爾主宰了通靈學院的屍骨儲藏所。他威脅要扭曲整個靈魂國度來達到他自己的目的，我們必須阻止他!這就是水晶球可以幫助你的地方。$B$B在屍骨儲藏所地下室的中心使用預言水晶球，以此來召喚達克雷爾的靈魂爪牙。擊敗這些靈魂，接下來死亡騎士就會出現了。$n，把他的頭帶給我!只有他的死亡才可以將靈魂國度的局勢扭轉過來!', '', '', '', '', '', '', 39653),
(8067, 'zhTW', '權力珍寶:捕獵者披肩', '從祖爾格拉布把以下權力珍寶帶給盲眼法希爾:1塊原始哈卡萊聖禦盾。你還必須在贊達拉部族中達到崇敬或更高的聲望。$B$B盲眼法希爾在荊棘谷的尤亞姆巴島上。', '我們贊達拉部族將衣著視為成就的象徵。你無需觀察別人的衣著，只需感覺它所散發的力量—力量超越視覺。贊達拉捕獵者的衣服正是如此，他們最珍視的莫過於披肩了。披肩能使他們的身形變得模糊...並可以隨心所欲地顯形。$B$B去祖爾格拉布取回我需要的權力珍寶。幫我把我尋找的東西帶來，捕獵者披肩就屬於你了。', '', '', '', '', '', '', 39653),
(8066, 'zhTW', '權力珍寶:捕獵者腰帶', '從祖爾格拉布把以下權力珍寶帶給盲眼法希爾:1條原始哈卡萊披巾。你還必須在贊達拉部族中達到尊敬或更高的聲望。$B$B盲眼法希爾在荊棘谷的尤亞姆巴島上。', '捕獵者知道如何追蹤獵物，而成功的捕獵者知道如何一擊解決他的獵物。你必須掌握這兩種技能才能在祖爾格拉布生存下來...才有可能具備贊達拉捕獵者的風采。$B$B從祖爾格拉布帶回我需要的權力珍寶。我將抽取那些飾品的力量，而你會得到贊達拉捕獵者腰帶—這是筆好買賣。', '', '', '', '', '', '', 39653),
(8062, 'zhTW', '權力珍寶:捕獵者護腕', '從祖爾格拉布把以下權力珍寶帶給盲眼法希爾克:1條原始哈卡萊束腕。你還必須在贊達拉部族中達到友好或更高的聲望。$B$B盲眼法希爾克在荊棘谷的尤亞姆巴島上。', '在古拉巴什帝國毀滅後的黑暗歲月裡，贊達拉捕獵者憑藉自己的能力維繫著部族的生存。獵人跟我們部族的捕獵者很像─狩獵便是捕獵者的基本工作。你在祖爾格拉布的狩獵之旅將證明你有沒有資格成為捕獵者中的一員。$B$B從祖爾格拉布取回權力珍寶吧，如果你成功了，那麼你就會在成為捕獵者的生涯中邁出第一步。', '', '', '', '', '', '', 39653),
(6163, 'zhTW', '拉姆斯登', '到斯坦索姆去，殺掉『暴食者』拉姆斯登。把他的頭顱交給納薩諾斯。', '我被完全擊敗了。為了守衛我們的家園，為了守衛羅德隆，我在這裡絕望地戰鬥著...一切抵抗者都在潮水般的天譴士兵面前被夷為廢墟。$B$B那個邪惡而骯髒的怪物把我踏在腳下，我能看到它的內臟掛在破碎的胸腔中。$B$B我被天譴軍團喚醒了，一直以來，我是如此的無助。我的意志被巫妖王牢牢地控制著。$B$B她趕來解救了我...不管用什麼方式，在什麼地方，我知道她早晚會這麼做的。自由。$B$B現在，我必須進行復仇─對那些奪取我生命的敵人進行復仇。毀滅它。', '', '', '', '', '', '', 39653),
(5167, 'zhTW', '炫彩挑戰者腿鎧', '為了鑄造炫彩挑戰者腿鎧，你必須把以下材料交給雕刻者耶茲巴:$B$B1塊炫彩龍鱗。$B$B10塊閃亮的炫彩龍鱗。$B$B10份英雄之血。$B$B5塊暗影之皮。', '成年炫彩巨龍的外殼是製造護脛的基礎。炫彩龍鱗將被用於製作鑲邊，最後在英雄之血中進行洗禮。最後，暗影之皮的力量將被注入護脛中。', '', '', '', '', '', '', 39653),
(4133, 'zhTW', '薇薇安·拉格雷', '與卡加斯的暗影大師薇薇安·拉格雷談話。', '暗影大師薇薇安·拉格雷需要你的幫助。她在荒蕪之地，就在獸人的卡加斯前哨基地裡，她在調查黑石深淵的黑鐵矮人。$B$B去和薇薇安談談吧，她正在等著你。', '', '', '', '', '', '', 39653);
